javascript/scope.html.body:
스코프(Scope)
변수의 유효범위를 결정하는 규칙이다. 스코프는 변수가 선언된 위치에 따라 결정되며, 변수에 접근할 수 있는 범위를 나타냅니다.
JavaScript는 다른 언어와 다르게 블록 레벨 스코프를 가지는게 아니다. var 키워드로 선언된 변수나, 함수 선언식으로 만들어진 함수는 함수 레벨 스코프를 가진다. 즉, 함수 내부 전체에서 유효한 식별자가 된다.

ES6 문법부터 let, const가 추가되면서 블록 레벨 스코프({})를 사용할 수 있다.

1. 전역 스코프(Global Scope)
var global = 'global';

코드 어디에서든지 접근 가능한 스코프입니다. 모든 함수와 블록의 외부에서 선언된 변수들이 전역 스코프에 속합니다.
2. 지역(함수) 스코프(Local or Function Scope)
var a = 10;     // 전역변수

(function () {  // 지역변수
  var b = 20;
})();

console.log(a); // 10
console.log(b); // Error: b는 함수 레벨 스코프로 선언되지 않았다고 에러

함수 내부에서 선언된 변수들이 속하는 스코프입니다. 해당 함수가 호출될 때마다 새로운 지역 스코프가 생성됩니다.
3. 블록 스코프(Block Scope)
var x = 0;
{
  var x = 1;
  console.log(x); // 1
}
console.log(x);   // 1

let y = 0;
{
  let y = 1;
  console.log(y); // 1
}
console.log(y);   // 0

위에서도 이야기 했듯이 ES6 문법부터 let과 const가 등장하게 되면서 블록({}) 내부에서 선언된 변수들이 속하는 스코프입니다.
4. 렉시컬 스코프(Dynamic Scope)
프로그래밍 언어는 동적 스코프 방식과 정적 스코프 또는 렉시컬 스코프를 가집니다. 자바스크립트를 비롯한 대부분의 프로그래밍 언어는 렉시컬 스코프를 따른다.
함수를 어디서 호출하는지가 아니라 어디에 선언하였는지에 따라 스코프가 결정되는 스코프입니다.
var x = 1;

function foo() {
  var x = 10;
  bar();
}

function bar() {
  console.log(x);
}

foo(); // 1
bar(); // 1

javascript/this.html.body:
this
JavaScript 에서 this는 현재 실행 컨텍스트에서 바인딩된 객체를 가리킵니다. this는 함수를 어떻게 호출했느냐에 따라 달라지며, 함수를 호출한 방식에 따라 this에 바인딩되는 값이 결정됩니다.

JavaScript에서 함수는 호출될 때, 자동적으로 함수에 arguments 객체와 this가 암묵적으로 받는다.

일반적으로 함수 호출 방식에 따른 this의 값은 다음과 같습니다.
들어가기 전 기본적으로 아래 내용을 알고 가야한다. 전역 객체(Global Object)는 모든 객체의 유일한 최상위 객체를 의미한다.
// Browser-side
this === window // true

// node 일 때: Server-side
this === global // true

1. 일반 함수 호출
전역 객체(window 또는 global - node.js)에 바인딩 됩니다.
var ga = 'global variable';

console.log(ga); // global variable
console.log(window.ga); // global variable

function foo() {
  console.log('Hello');
}
window.foo(); // Hello

내부 함수는 일반 함수, 메소드, 콜백함수 어디에서 선언되었든 관계없이 this는 전역객체에 바인딩한다.
2. 메소드 호출
메소드가 속한 객체에 바인딩 됩니다.
var obj1 = {
  name: 'Park',
  sayName: function() {
    console.log(this.name);
  }
}

var obj2 = {
  name: 'Jin'
}

obj2.sayName = obj1.sayName;

obj1.sayName(); // Park
obj2.sayName(); // Jin

3. 생성자 함수 호출
새로 생성되는 객체에 바인딩 됩니다.
// 생성자 함수
function Person(name) {
  this.name = name;
}

var me = new Person('Park');
console.log(me); // Person {name: "Park"}

4. call, apply, bind 메소드 호출
this는 바인딩될 객체는 함수 호출 패턴에 의해 결정되므로 특정 객체에 명시적으로 바인딩하는 방법을 제공한다.(지정된 객체에 해당 메소드를 사용하여 바인딩)

typescript/everyday-type.html.body:
Everyday Types
TypeScript 코드를 작성할 때 가장 기본적이면서 흔이 만날 수 있는 타입들에 대해 알아보자
1. 원시 타입
string
문자열 값은 String
number
int, float 같은 건 존재하지 않고 모든 수는 Number
boolean
True false 값은 boolean
bigint
아주 큰 정수를 다루기 위한 원시 타입
// BigInt 함수를 통하여 bigint 값을 생성
const oneHundred: bigint = BigInt(100);

// 리터럴 구문을 통하여 bigint 값을 생성
const anotherHundred: bigint = 100n;

symbol
전역적으로 고유한 참조값을 생성하는 데에 사용할 수 있는 원시 타입
const firstName = Symbol("name");
const secondName = Symbol("name");

if (firstName === secondName) {.
  // 절대로 일어날 수 없습니다
}

2. 배열
[1, 2, 3]과 같은 배열의 타입을 지정할 때 number[] 또는 Array 처럼 지정 가능
3. any
어떤 타입을 할당해야 할지 모를 때 사용하는 타입

변수 선언 후 초기화 과정에서 아무런 값을 할당하지 않을 시 any 타입이 자동 지정
  noImplicityAny를 설정 시 any로 간주하는 모든 경우에 오류 발생을 시키게 할 수 있음



4. 변수에 대한 타입 표기
const, var, let 등을 사용하여 변수를 선언할 때 타입을 명시적으로 지정하기 위해 타입을 표기할 수 있다
let myName: string = 'Park';

let yourName = 'Ho';
/* 
 TypeScript에서는 자동으로 초깃값을 바탕으로 타입 추론
 let yourName: string = 'Ho';
*/

가능하면 최대한 타입 표기를 적게 사용하게끔 타입 지정
5. 함수
// 매개변수 타입 표기
function myName(name: string) {
 console.log(`Hello, my name is ${name}`);
}

// 반환 타입 표기
function getFavoriteNumber(): number {
 return 7;
}


함수도 변수와 마찬가지로 반환 타입을 표기하지 않아도 되며, return 문을 바탕으로 반환 타입을 추론함

6. 익명함수
const names = ['Park', 'Hoo'];

names.forEach((name) => {
 console.log(name.toUppercase());
});


TypeScript는 함수가 실행되는 문맥을 통해 해당 함수가 가져야하는 타입을 알 수 있다. 이러한 과정은 문맥적 타입 부여 라고 칭한다.

7. 객체 타입
function printCoord(pt: { x: number; y: number }) {
  console.log("The coordinate's x value is " + pt.x);
  console.log("The coordinate's y value is " + pt.y);
}
printCoord({ x: 3, y: 7 });

// 옵셔널 프로퍼티 예시
function printName(obj: { first: string; last?: string }) {

 /*
  console.log(obj.last.toUpperCase()); 

  위와 같이 사용하면 아래와 같은 에러가 뜬다. 존재하지 않은 프로퍼티에 접근 시
  런타임 오류가 아닌 'undefiend` 값을 얻게 된다.

  Error: 'obj.last' is possibly 'undefiend'.
 */

 // 그래서 오류가 안 뜨게 하려면 아래와 같이 체크가 필요하다.
 if (obj.last !== undefined) {
    console.log(obj.last.toUpperCase());
  }

  // 최신 JavaScript 문법을 사용하였을 때 또 다른 안전한 코드
  console.log(obj.last?.toUpperCase());

 return `${first} ${last}`;
}
printName({ first: "Bob" }); // last는 옵셔널 프로퍼티이므로 선택적으로 넣거나 빼도 상관없다
printName({ first: "Alice", last: "Alisson" });


프로퍼티 구분 시 , 또는 ; 으로 구분이 가능하며 타입을 지정하지 않을 시에는 any 타입으로 간주한다.
객체 타입에 옵셔널 프로퍼티 를 지정할 수 있는데 선택적 타입으로 ? 를 붙이면 된다.

8. 유니언(의미: 합집합) 타입
서로 다른 두 개 이상의 타입들을 사용하여 만드는 것으로 조합에 사용된 타입 중 무엇이든 하나의 타입을 가질 수 있습니다.
function printId(id: number | string) {
  console.log("Your ID is: " + id);

 /*
  위에서 유니언 타입으로 number와 string을 지정하였는데,
  string에서만 유효한 메서드를 사용할 수 없습니다.
 */
 console.log(id.toUpperCase()); // 오류

 /*
  만약 억지로 쓰고 싶다면 typeof 연산을 사용하여 체크 후 사용할 수 있습니다.
 */
 if (typeof id === "string") {
    // 이 분기에서 id는 'string' 타입을 가집니다
    console.log(id.toUpperCase());
  } else {
    // 여기에서 id는 'number' 타입을 가집니다
    console.log(id);
  }
}

printId(101); // 성공
printId("202"); // 성공
printId({ myID: 22342 }); // 오류

9. 타입 별칭
똑같은 타입을 한 번이 아닌 여러 번 재 사용하기 위함 또는 다른 이름으로 부르고 싶은 경우를 위해 타입 별칭을 사용합니다.
type ID = number | string; // 유니언 타입: number, string

/* 
 function printCoord(pt: { x: number; y: number }) {
   console.log("The coordinate's x value is " + pt.x);
   console.log("The coordinate's y value is " + pt.y);
 }
 위 코드와 같은 코드입니다.
*/

type Point = {
  x: number;
  y: number;
}; // Point 타입은 x: number, y: number

function printCoord(pt: Point) {
  console.log("The coordinate's x value is " + pt.x);
  console.log("The coordinate's y value is " + pt.y);
}

printCoord({ x: 100, y: 100 });

// 다른 이름으로 부르고 싶은 경우
type UserInputSanitizedString = string;

function sanitizeInput(str: string): UserInputSanitizedString {
  return sanitize(str);
}

10. 인터페이스
시용 방법은 이전에 배운 타입 별칭 과 동일하다.
interface Point {
  x: number;
  y: number;
}

function printCoord(pt: Point) {
  console.log("The coordinate's x value is " + pt.x);
  console.log("The coordinate's y value is " + pt.y);
}

printCoord({ x: 100, y: 100 });

💡 여기서 잠깐!
그럼 타입과 인터페이스의 차이점 은 무엇일까?
1. interface 확장하기
interface Animal {
  name: string
}

interface Bear extends Animal {
  honey: boolean
}

const bear = getBear()
bear.name
bear.honey

기존 interface에 새 필드 추가가 가능하다.
interface Window {
  title: string
}

interface Window {
  ts: TypeScriptAPI
}

const src = 'const a = "Hello World"';
window.ts.transpileModule(src, {});

2. type 확장하기
type Animal = {
  name: string
}

type Bear = Animal & {
  honey: Boolean
}

const bear = getBear();
bear.name;
bear.honey;

type은 생성 된 이후 확장이 불가능하다.
type Window = {
  title: string
}

type Window = {
  ts: TypeScriptAPI
}

// Error: Duplicate identifier 'Window'.

타입과 인터페이스의 차이점

타입 별칭은 선언 병합에 포함될 수 있지만, 인터페이스는 포함될 수 있습니다.
인터페이스는 오직 객체의 모양을 선언하는 데에만 사용되며, 기존의 원시 타입에 별칭을 부여하는 데에는 사용할 수 없습니다.
인터페이스 이름은 항상 있는 그대로 오류 메시지에 나타납니다.
(인터페이스가 이름으로 사용되었을 때)


개인적인 선호에 따라 interface 또는 type 을 선택할 수 있지만, 코드가 조금 더 명시적이고 유연한 interface 를 사용하고 이후 문제가 발생 했을 시 type 을 사용하면 좋다.

11. 타입 단언
TypeScript 보다 당신이 어떤 값의 타입에 대한 정보를 더 잘 아는 경우 구체적으로 명시하기 위해 서용된다.
const myCanvas = document.getElementById("main_canvas") as HTMLCanvasElement;

/*
 위 코드에서 getElementById를 사용 시 반환 값을 TypeScript는 HTMLElement 중 
 무언가 반환된다는 것을 알지만 우리는 HTMLCanvasElement가 반환된다는 사실을 알고 있으므로
 위와 같이 타입 단언을 할 수 있다.
*/

// 아래와 같이도 사용 가능하다.
const myCanvas = document.getElementById("main_canvas");

 타입 단언은 컴파일러에 의하여 제거되며 코드의 런타임 동작에는 영향을 끼치지 않는다.
12. 리터럴 타입
일반적인 타입(string, number)과 다르게 구체적인 문자열과 숫자 값을 타입 위치에 지정할 수 있다.
/*
 문맥적 타입으로 인해 
 let changingString = 'Park'; 같은 경우에 타입은 string으로 모든 문자열을 입력이 가능

 const constantString = 'Park' 같은 경우에는 const로 선언 시 재 할당이 불가능 하므로
 'Park` 이라는 타입으로 고정
*/

let changingString = "Park";
changingString = "Hoo";

changingString; // let changingString: string

let changingString: string

const constantString = "Park";
constantString;  // let changingString: 'Park'

// 구체적인 문자열을 사용한 예
function printText(s: string, alignment: "left" | "right" | "center") {
  // ...
}
printText("Hello, world", "left");
printText("G'day, mate", "center");

// 구체적인 숫자를 사용한 예
function compare(a: string, b: string): -1 | 0 | 1 {
  return a === b ? 0 : a > b ? 1 : -1;
}

리터럴 추론
객체를 사용하여 변수를 초기화하면, TypeScript는 해당 객체의 프로퍼티는 이 후에 값이 변화할 수 있다고 가정합니다.
const req = { url: "https://example.com", method: "GET" };
handleRequest(req.url, req.method);

// Argument of type 'string' is not assignable to parameter of type '"GET" | "POST"'.

// 수정 1:
const req = { url: "https://example.com", method: "GET" as "GET" };

// 수정 2
handleRequest(req.url, req.method as "GET");

// as const로 객체 전체를 리터럴 타입으로 변환 가능
const req = { url: "https://example.com", method: "GET" } as const;
handleRequest(req.url, req.method);

13. null과 undefined
JavaScript에는 빈 값 또는 초기화되지 않는 값을 가리키는 두 가지 원시값이 존재합니다.
TypeScript에는 각 값에 대응하는 동일한 이름의 두 가지 타입이 존재하는데 이는 strictNullChecks 옵션에 따라 설정이 달라진다.
strictNullChecks 설정 시
어떤 값이 null 또는 undefined 일 때, 해당 값과 함께 메서드 또는 프로퍼티를 사용하기에 앞서 해당 값을 테스트 해야한다.
function doSomething(x: string | undefined) {
  if (x === undefined) {
    // 아무 것도 하지 않는다
  } else {
    console.log("Hello, " + x.toUpperCase());
  }
}

// Null 아님 단언 연산자
function liveDangerously(x?: number | undefined) {
  /* 
  명시적 검사 없이 표션식 뒤에 '!'를 작성하면 해당 값이 'null' 또는 'undefiend'가
  아니라고 타입을 단언할 수 있으며 반드시 해당 값이 'null' 또는 'undefiend'가 아닌 
  경우에만 사용해야 합니다.
 */
  console.log(x!.toFixed());
}

strictNullChecks 설정되지 않았을 때
null, undefined를 모든 타입 변수에 대입할 수 있으며, Null 검사를 하지 않는 언어의 동작 방식과 유사하다. Null 검사의 부재는 버그의 주요 원인이 되기도 하여 별다른 이유가 없다면 strictNullChecks 옵션 설정을 권장한다.

typescript/narrowing.html.body:
Narrowing
TypeScript 에서 변수는 덜 정확한 타입에서 더 정확한 타입으로 변할 수 있는데 이러한 과정을 type narrowing이라고 합니다.
interface Animal = {
    name: string;
    count?: number;
};

function addAnimal(animal: Animal){
  animal.count = animal.count + 1; // type 에러!! Object is possibly 'undefined'
}

위 예시를 보면 count 프로퍼티가 undefined가 될 수 있기 때문에 타입 에러가 발생할 수 있습니다.  addAnimal을 보면 inteface Animal의 count가 number 또는 undefined가 올 수도 있으므로 type 에러가 뜬다. 정리해 보면 현재 덜 정확한 타입에서 더 정확한 타입으로 변할 수 있게끔 하는 과정을 type narrowing 이라고 한다.
지금부터는 6가지 방법의 type narrowing 방법을 알아보자!
1. typeof type guards
JavaScript에서 연산자 유형을 제공하는데 typeof 를 통해서 type narrowing을 할 수 있다. 종류는 아래와 같다.

String
Number
bigint
boolean
symbol
undefined
object
function

function printAll(strs: string | string[] | null) {
  if (typeof strs === "object") {
    console.log(strs); // strs이 object 타입
  } else if (typeof strs === "string") {
    console.log(strs); // strs이 string 타입
  } else if (typeof strs === "null") {
    console.log(strs); // strs이 null 타입
  } else {
    // do nothing
  }
}

2. Truthiness narrowing
boolean 처럼 명령문의 조건이 항상 true or false 일 때 유용하게 사용되는 type narrowing 이다.

0
NaN
"" (the empty string)
0n (the bigint version of zero)
null
undefined

interface Animal = {
    name: string;
    count?: number;
};

/*
function addAnimal(animal: Animal){
  animal.count = animal.count + 1; // type 에러!! Object is possibly 'undefined'
}

이전 에러는 아래와 같이 수정하면 통과한다.
*/

function addAnimal(animal: Animal){
 if (animal.count) {
  animal.count = animal.count + 1; 
 } 
}

3. Equality narrowing
TypeScript는 스위치 문 또는 ===, !==, ==, != 와 같은 등식 검사를 유형을 좁힌다.
function example(x: string | number, y: string | boolean) {
  if (x === y) {
    // 위의 등식 검사를 통과하면 x, y는 String 이다.
    x.toUpperCase();
    y.toLowerCase();
  } else {
    console.log(x); // string | number
    console.log(y); // string | boolean
  }
}

function printAll(strs: string | string[] | null) {
  if (strs !== null) {
  // 여기를 통과하면 strs는 string | string[]
    if (typeof strs === "object") {
   // 여기를 통과하면 strs는 string[]
      for (const s of strs) {
        console.log(s);
      }
    } else if (typeof strs === "string") {
   // 여기를 통과하면 strs는 string
      console.log(strs);
    }
  }
}

interface Container {
  value: number | null | undefined;
}

function multiplyValue(container: Container, factor: number) {
  if (container.value != null) {
  // 아래 등식을 통과 시 undefiend 와 null 타입이 제거된 number로 된다. 
    console.log(container.value);
    container.value *= factor;
  }
}

4. The in operator narrowing
TypeScripts는 in 연산자를 통해 이름의 속성을 이용하여 잠재적인 유형을 좁힐 수 있다.
interface Person {
    firstName: string;
    lastName: string;
}
interface Organization {
    name: string;
}
type Contact = Person | Organisation;

function sayHello(contact: Contact) {
    if ("firstName" in contact) {
    /* 
     아래 등식을 통과 시 contact는 Person 타입으로 
     좁혀지고 타입 에러가 발생하지 않는다.
    */
        console.log("Hello " + contact.firstName);
    }
}

5. instanceof narrowing
instanceof 를 사용하여 해당 변수가 사용하고 있는 prototype chain을 통해 포함되어 있는지를 체크하여 타입을 좁힌다.
class Person {
    constructor(
        public firstName: string,
        public lastName: string
    ) {}
}
class Organisation {
    constructor(public name: string) {}
}
type Contact = Person | Organisation;

function sayHello(contact: Contact) {
  /*
     console.log("Hello " + contact.firstName);
   만약 위와 같이 출력한다면 contact이 
  */
  if (contact instanceof Person) {
     console.log("Hello " + contact.firstName);
  }
}

6. Assignments
변수 할당을 통해 타입을 좁힌다.
let x = Math.random() 
7. Control flow analysis
코드 분석을 통해 제어 흐름을 파악하여 유형을 좁힌다.
function example() {
  let x: string | number | boolean;
  x = Math.random() 
8. Using type predicates
TypeScript 컴파일러에 특정 값이 어떤 유형인지 알리는 특수 반환 유형이다.
type Rating = 1 | 2 | 3 | 4 | 5;

async function getRating(productId: string) {
 const response = await fetch(
  /products/${productId}
 );
 const product = await response.json();
 const rating = product.rating;
 return rating;
}

위 예제에서 getRating의 리턴 타입은 Promise로 추측 되는데, 이 함수의 리턴 값을 변수에 할당 시 any 타입을 가지게 된다.
이 말은 즉 아무런 타입 확인이 일어나지 않는다는 말이 된다.
이때 우리는 type predicate 를 가지게 함수를 만들어 더욱 코드 타입을 안정적이게 할 수 있다.
function isValidRating(
  rating: any
): rating is Rating {
  if (!rating || typeof rating !== "number") {
    return false;
  }
  return (
    rating === 1 ||
    rating === 2 ||
    rating === 3 ||
    rating === 4 ||
    rating === 5
  );
}

rating is Rating 은 바로 type predicate 입니다. type predicate 를 사용 시에는 무조건 boolean 값을 리턴해야한다. 이제 위에 코드를 수정해보자.
async function getRating(productId: string) {
  const response = await fetch(
    `/products/${productId}`
  );
  const product = await response.json();
  const rating = product.rating;
  if (isValidRating(rating)) {
    return rating; // type: Rating
  } else {
    return undefined;
  }
}

isValidRating()을 통해 if문 안의 rating의 타입은 Rating이 된다.
9. Discriminated unions
각 Union안에 동일한 키(key)를 갖지만 다른 값(value)을 갖도록 만들 수 있다.
1. DisCriminated unions을 사용 안한 경우
interface Shape {
  kind: "circle" | "square";
  radius?: number;
  sideLength?: number;
}

function getArea(shape: Shape) {
  if (shape.kind === "circle") {
    return Math.PI * shape.radius! ** 2;
  }
}

2. DisCriminated unions을 사용한 경우
interface Circle {
  kind: "circle";
  radius: number;
}

interface Square {
  kind: "square";
  sideLength: number;
}

type Shape = Circle | Square;

function getArea(shape: Shape) {
  switch (shape.kind) {
    case "circle":
      return Math.PI * shape.radius ** 2;
    case "square":
      return shape.sideLength ** 2;
  }
}


DisCriminated unions을 사용 시 코드를 조금 더 직관적으로 작성 가능
공통적인 property를 통해 구분이 쉬움

10. The never type
Narrowing을 사용하여 범위를 계속 좁히다 보면 아무것도 남지 않는 수준으로 줄여질 수 있는데 이 경우는 TypeScript에서 존재해서는 안 된다는 것을 나타내기 위해 never type을 사용한다.

never 유형은 모든 유형에 할당할 수 있지만 never 유형에 never 유형을 할당할 수 없다.

11. Exhaustiveness checking
예상치 못한 런타임 에러를 미연에 방지하기 위해 철저하게 검사한다.
type Shape = Circle | Square;

function getArea(shape: Shape) {
  switch (shape.kind) {
    case "circle":
      return Math.PI * shape.radius ** 2;
    case "square":
      return shape.sideLength ** 2;
    default:
   /* 
    _exhautiveCheck 까지 왔다면 circle 도 square 도 아니라 어떤 type인지
    체크가 불가능하다. 이러한 경우 never type을 사용한다.
   */
      const _exhaustiveCheck: never = shape;
      return _exhaustiveCheck;
  }
}

여기서 만약 새로운 Shape를 추가하면 어떻게 될까?
interface Triangle {
  kind: "triangle";
  sideLength: number;
}

type Shape = Circle | Square | Triangle;

function getArea(shape: Shape) {
  switch (shape.kind) {
    case "circle":
      return Math.PI * shape.radius ** 2;
    case "square":
      return shape.sideLength ** 2;
    default:
      /* 
        아래와 같이 _exhaustiveCheck에 never type을 적용하면 에러가 뜬다.
        현재 Shape는 Circle | Square | Triangle 타입이 있는데, switch 문 중 Triangle 타입에 대한 케이스가 없기에 에러 메세지가 뜬다.
        Type 'Triangle' is not assignable to type 'never'.
      */
      const _exhaustiveCheck: never = shape;

      return _exhaustiveCheck;
  }
}

typescript/more-on-functions.html.body:
More on Functions
TypeScript 함수들이 어떻게 호출될 수 있는지를 설명하는 방법을 알아보자
1. Function Type Expressions(함수 타입 유형식)
// (a: string)의 의미는 fn 함수는 a에 string Type인 파라미터를 가진 함수의 뜻이다. 
// Type을 지정하지 않을 시에는 암묵적으로 any Type이 지정된다.
function greeter(fn: (a: string) => void) {
  fn("Hello, World");
}

// 물론 위 형식을 아래와 같이 'type alias'로 사용 가능하다.
type GreetFunction = (a: string) => void;
function greeter(fn: GreetFunction) {
  // ...
}

function printToConsole(s: string) {
  console.log(s);
}

greeter(printToConsole);

2. Call Signatures(호출 시그니처)
type DescribableFunction = {
  description: string;
  (someArg: number): boolean;
};
function doSomething(fn: DescribableFunction) {
  console.log(fn.description + " returned " + fn(6));
}

함수 유형식(Function type expression)은 =>를 사용하고 개체 유형식(Call Signatures)은 : 을 사용한다.
3. Construct Signatures(구성 시그니처)
생성자 함수 타입 지정 방식이다
type SomeConstructor = {
  new (s: string): SomeObject;
};
function fn(ctor: SomeConstructor) {
  return new ctor("hello");
}

상수 유형식을 활용하여 아래와 같이 사용할 수 있다.
interface CallOrConstruct {
  new (s: string): Date; // construct
  (n?: number): number; // call
}

// construct
let object: Date = new CallOrConstruct("optional string s");
// call
let myNumber: number = CallOrConstruct(/* n= */ 42);

하나의 함수 객체가 두 가지 목적을 수행하는 경우 TypeScript로 양쪽 모두 타입을 지정하여 결합시킬 수 있다.
4. 제네릭 함수
제네릭 문법이 두 값 사이에 상관관계를 표현하기 위해 사용된다.
function firstElement(arr: Type[]): Type | undefined {
  return arr[0];
}

// s는 "string" 타입
const s = firstElement(["a", "b", "c"]);
// n은 "number" 타입
const n = firstElement(ㅏ[1ㅈ, 2, 3]);
// u는 "undefined" 타입
const u = firstElement([]);

추론
Type을 특정하지 않았음에도 Type을 자동적으로 추론합니다.
function map(arr: Input[], func: (arg: Input) => Output): Output[] {
  return arr.map(func);
}

const parsed = map(["1", "2", "3"], (n) => parseInt(n));
/*
 여기서의 매개변수 n은 type이 string으로 추론되며, 
 parsed의 type은 number[] type으로 추론한다.
*/

타입 제한 조건
두 값을 연관시키기 위해 특정한 값들의 부분집합에 한해 동작하게 타입을 제한할 수 있다.
// 아래 같이 정의함으로써 a, b의 매개변수에 대해서 .length 프로퍼티에 접근할 수 있어야한다.
function longest(a: Type, b: Type) {
  if (a.length >= b.length) {
    return a;
  } else {
    return b;
  }
}

const longerArray = longest([1, 2], [1, 2, 3]); // type: number[]
const longerString = longest("alice", "bob"); // type: alice | bob
const notOK = longest(10, 100); // Error: Number object에는 length 프로퍼티를 가지고 있지 않음

타입 인수를 명시하기
TypeScript는 제네릭 호출에서 의도된 type을 대체로 추론해 내지만 예외인 부분도 있다.
function combine(arr1: Type[], arr2: Type[]): Type[] {
  return arr1.concat(arr2);
}

const arr = combine([1, 2, 3], ["hello"]); // Error: Type 'string' is not assignable to type 'number'.

// 아래와 같이 의도 했다면 수동으로 type을 명시해야한다.
const arr = combine([1, 2, 3], ["hello"]);

좋은 제네릭 함수를 작성하기 위한 가이드라인

타입 매개변수를 누르기
  // A 방식
  function firstElement1(arr: Type[]) {
    return arr[0];
  }

  // B 방식
  function firstElement2(arr: Type) {
    return arr[0];
  }

  // a: number (good)
  const a = firstElement1([1, 2, 3]);
  // b: any (bad)
  const b = firstElement2([1, 2, 3]);

  /*
   A 방식이 함수를 작성하는데 더 좋은 방법이며, 최대한 타입 매개변수를 제약하기
   보다는 타입 매개변수를 최대한 사용한다.
  */


더 적은 타입 매개변수를 사용하기
  // A 방식
  function filter1(arr: Type[], func: (arg: Type) => boolean): Type[] {
    return arr.filter(func);
  }

  // B 방식
  function filter2 boolean>(
    arr: Type[],
    func: Func
  ): Type[] {
    return arr.filter(func);
  }

  /*
   A 방식이 함수를 작성하는데 더 좋은 방법이며, 
   항상 가능하다면 타입 매개변수를 최소로 사용한다. 
  */


타입 매개변수는 두 번 나타나야 한다.
  // A 방식
  function greet(s: Str) {
    console.log("Hello, " + s);
  }

  // B 방식
  function greet(s: string) {
    console.log("Hello, " + s);
  }

  greet("world");

  /*
   타입 매개변수는 여러 값의 타입을 연관시키는 용도로 사용함으로 B 방식인
   기존 함수 타입 유형식의 함수를 작성하는데 더 좋은 방법이다.
  */



5. 선택적 매개변수
? 로 표시함으로 선택적 매개변수를 만들 수 있다.
function f(x?: number): void {
  // ...
}
f(); // OK
f(10); // OK
f(undefined); // OK

/*
 매개변수 타입이 number로 지정되어 있지만 명시되지 않은 매개변수는 undefiend가
 되기 때문에, x 매개변수는 실질적으로 number | undefiend 타입이 될 것이다.
*/

콜백 함수에서 선택적 매개변수
선택적 매개변수 및 함수 타입 표현식에 대해 알게 되면, 콜백을 호출하는 함수를 작성할 때 잦은 실수들이 발생한다.
function myForEach(arr: any[], callback: (arg: any, index?: number) => void) {
  for (let i = 0; i  console.log(a));
myForEach([1, 2, 3], (a, i) => console.log(a, i));

/*
 위 함수의 의도는 위 두 호출 모두 유효하기를 바래서 사용했지만,
 의미하는 바는 callback이 하나의 인수로 호출될 수 있다 라는 이유가 되기 때문에
 TypeScript는 이러한 의미를 강제하여 실제로 일어나지 않게 에러를 발생시킨다.
*/

위 이야기는 즉 기존 JavaScript에서 매개변수로 지정한 것보다 많은 인수를 전달하여 호출 시 남은 인수들은 단순히 무시된다. TypeScript도 마찬가지 방식으로 동작한다고 보면 된다. 같은 타입을 가진 매개변수가 더 적은 함수는 더 많은 매개변수가 있는 함수를 대체할 수 있다.

💡 콜백에 대한 함수 타입을 작성할 때, 해당 인수 없이 호출할 의도가 없는 한, 절대로 선택적 매개변수를 사용하지 말자!

6. 함수 오버로드
동일한 이름에 매개변수만 다른 여러 버전의 함수를 만드는 것을 함수 오버로드라고 한다. 다시 말해 함수 이름은 같지만 매개변수 또는 반환값의 타입이 다른 함수라고 이야기할 수 있다. 함수 오버로드는 선언부 와 구현부 로 나뉘어 지는데 선언부 에서는 가능한 매개변수 타입만 지정하고, 함수 구현은 구현부 에서만 이루어진다. 순서: 선언부 → 구현부

함수 본문을 작성하기 위해 사용된 시그니처는 외부에 노출되지 않으며, 오버로드된 함수 작성 시 두 개 이상의 시그니처를 함수 구현 위에 작성해야 한다.
구현 시그니처는 오버로드된 시그니처와 호환이 되어야 한다.
선언부 는 최소 두 개 이상이어야 한다.

// 선언부
function makeDate(timestamp: number): Date;
function makeDate(m: number, d: number, y: number): Date;

// 구현부
function makeDate(mOrTimestamp: number, d?: number, y?: number): Date {
  if (d !== undefined && y !== undefined) {
    return new Date(y, mOrTimestamp, d);
  } else {
    return new Date(mOrTimestamp);
  }
}
const d1 = makeDate(12345678);
const d2 = makeDate(5, 5, 5);
const d3 = makeDate(1, 3); // Error: 선언부에 의하면 매개변수는 1개 or 3개

문자열 혹은 배열의 길이를 반환하는 함수인 예시이다.
function len(s: string): number;
function len(arr: any[]): number;
function len(x: any) {
  return x.length;
}

len('');
len([0]);
len(1); // Error: 선언부의 타입과 일치하지 않음

위 함수는 string | array를 통해서 호출할 수 있습니다. 하지만, TypeScript는 하나의 오버로드를 통해서 함수를 해석하기 때문에 이 함수는 string | array가 될 수 있는 값을 통해서 호출할 수 없습니다.
이렇게 열심히 설명해 놓고 결국 공식 문서에서는 오버로드 쓰지말고 유니온 타입 쓰라고 한다
function len(x: any[] | string) {
  return x.length;
}

매우 훨씬 간결하고 명시적으로 바뀌었습니다. 하하.
함수 내에서 this 선언하기
TypeScripts는 함수 안에서 this 가 무엇이 되어야 할지, 코드 흐름 분석을 통해 추론한다. this를 사용 시 첫 번째 매개 변수로 선언한다.

JavaScript에서 this 라는 이름의 매개변수를 가질 수 없지만, TypeScript 는 해당 문법 공간을 함수 본문에서 this 의 타입 정의가 가능하다.
  interface DB {
    filterUsers(filter: (this: User) => boolean): User[];
  }

  const db = getDB();
  const admins = db.filterUsers(function (this: User) {
    return this.admin;
  });


일반적으로 다른 객체가 함수를 호출할 때 제어하는 콜백 스타일 API에서 흔히 사용된다. 이런 효과를 얻기 위해서는 arrow 함수가 아닌 function 키워드를 사용해야한다.
  interface DB {
    filterUsers(filter: (this: User) => boolean): User[];
  }

  const db = getDB();
  const admins = db.filterUsers(() => this.admin);
  /*
   Error: arrow 함수는 this의 전역 값에 해당한다는게 포인트
   The containing arrow function captures the global value of 'this'.
   Element implicitly has an 'any' type because type 'typeof globalThis' 
   has no index signature.
  */



알아야 하는 다른 타입
void
값을 반환하지 않는 함수의 반환 값을 의미합니다. 보통 return 문이 없거나 명시적으로 반환되지 않을 때 추론되는 타입이다.
function noop() {
 return;
}


JavaScript 에서는 아무것도 반환하지 않는 함수를 undefiend 값을 반환합니다. 하지만 TypeScript에서 void , undefiend 는 같은 것으로 간주되지 않습니다.(void ≠ undefiend)

object
원시 값(string, number, bigint, boolean, symbol, null, undefined)이 아닌 모든 값을 지칭하며, 빈 객체 타입 { } 와는 다르고, 전역 타입 Object 와도 다릅니다. (object ≠ Object)

💡 JavaScript에서 함수 값은 객체이다. 프로퍼티, 프로토타입 체인, Object Prototype, instanceof Object, Object.keys 등등이 있는데 TypeScript에서 함수 타입은 object 로 간주됩니다.

unknown
unknown 타입은 모든 값을 나타냅니다. any 타입과 유사하지만 unknown 타입에 어떤 것을 대입하는 것이 유효하지 않는다.
function f1(a: any) {
  a.b(); // OK
}
function f2(a: unknown) {
  a.b(); // Error: 'a' is of type 'unknown'.
}

unknown 타입의 값을 반환하는 함수를 만들어보자.
function safeParse(s: string): unknown {
  return JSON.parse(s);
}

// 'obj'를 사용할 때 조심해야 합니다!
const obj = safeParse(someRandomString);

never
never 타입은 결코 관측될 수 없는 값을 의미하며, 보통 함수의 예외 발생 또는 프로그램 실행 종료함을 의미한다.
function fail(msg: string): never {
  throw new Error(msg);
}

function fn(x: string | number) {
  if (typeof x === "string") {
    // type: string
  } else if (typeof x === "number") {
    // type: number
  } else {
    x; // type: never
  }
}

Function
전역 타입 Function은 bind, call, apply그리고 JavaScript 함수 값에 있는 다른 프로퍼티를 설명하는 데에 사용됩니다. 또한 여기에는 Function 타입의 값은 언제나 호출될 수 있다는 값을 가지며, 이러한 호출은 any를 반환합니다.
function doSomething(f: Function) {
  return f(1, 2, 3);
}

/*
  위의 경우 타입되지 않은 함수 호출이며, 안전하지 않은 any 타입을 반환하기 때문에
 최대한 () => void 타입을 사용하는게 좋다.
*/

나머지 매개변수와 인수
나머지 매개변수(Rest Parameter)
우리는 보통 선택적 매개변수와 오버로드를 사용하여 다양한 정해진 인수들을 받을 수 있지만, 우리가 정해지지 않은 수의 인수를 받아들이는 함수를 나머지 매개변수를 이용하여 정의할 수 있다.
function multiply(n: number, ...m: number[]) {
  return m.map((x) => n * x);
}

const a = multiply(10, 1, 2, 3, 4); // a -> [10, 20, 30, 40]

TypeScript에서는 매개변수에 대한 타입 표기는 암묵적으로 any[] 를 사용하며, 타입 표현식은 Array 또는 T[] 또는 튜플 타입으로 표현해야 한다.
나머지 인수(Rest Argument)
반대로 전개 구문을 사용하여 배열에서 제공되는 인수의 개수를 제공할 수 있다. TypeScript는 배열이 불변하다고 간주하지 않는다.
// 에러
const args = [8, 5];
const angle = Math.atan2(...args);
// Error: A spread argument must either have a tuple type or be passed to a rest parameter.

// 해결책
const args = [8, 5] as const;
const angle = Math.atan2(...args); // OK

매개변수 구조 분해(Parameter Destructing)
구조분해한 변수의 뒤에 타입을 지정하지 않고 구조분해한 { }뒤에 콜론을 찍고 타입을 지정
function sum({ a, b, c }: { a: number; b: number; c: number }) {
  console.log(a + b + c);
}

위 예제를 타입 별칭으로도 변환 가능합니다.
type ABC = { a: number; b: number; c: number };
function sum({ a, b, c }: ABC) {
  console.log(a + b + c);
}

함수의 할당가능성
void 반환 타입
함수의 void 반환 타입은 예측할 수 있는 동작을 발생시킬 수 있다.
void 반환 타입으로의 문맥적 타이핑은 함수를 아무것도 반환하지 않도록 강제하지 않습니다.
type voidFunc = () => void;

const f1: voidFunc = () => {
  return true;
};

const f2: voidFunc = () => true;

const f3: voidFunc = function () {
  return true;
};

리터럴 함수 정의가 void 반환 값을 가지고 있다면 그 함수는 어떠한 것도 반환해서는 안됩니다.

typescript/object-types.html.body:
Object Types
JavaScript에서는 객체를 통해서 데이터를 그룹화하여 전달한다. TypeScript에서 어떻게 객체 유형을 표현하는지에 대해 알아보자

interface version
 interface Persion {
   name: string;
   age: number;
 }

 function greet(person: Person){
   return "Hello " + person.name;
 }


type version`
 type Persion {
   name: string;
   age: number;
 }

 function greet(person: Person){
   return "Hello " + person.name;
 }



1. Property Modifiers
객체 유형에는 아래와 같이 3가지 경우가 있습니다
옵션 프로퍼티(Optional Properties)
속성 선택 사항을 ? 로 표시할 수 있습니다
interface PaintOptions {
  shape: Shape;
  xPos?: number; // 선택 사항 - type: number | undefined
  yPos?: number;  // 선택 사항 - type: number | undefined
}

function paintShape(opts: PaintOptions) {
 let xPos = opts.xPos === undefined ? 0 : opts.xPos; // type: number
 let yPos = opts.yPos === undefined ? 0 : opts.yPos; // type: number
}

const shape = getShape();
paintShape({ shape });
paintShape({ shape, xPos: 100 });
paintShape({ shape, yPos: 100 });
paintShape({ shape, xPos: 100, yPos: 100 });

위의 paintShape()는 xPos와 yPos의 초기값을 설정해 줌으로써 타입을 number로 속성을 설정할 수 있습니다. 위 방법 같은 경우에 매개변수에 구조 분해 할당 을 사용하여 기본값을 줌으로써 코드를 더 간단하고 명시적이게 줄일 수 있습니다.
function paintShape({ shape, xPos = 0, yPos = 0 }: PaintOptions) {
 // xPos, yPos type: number
}

읽기 프로퍼티(readonly Properties)
속성에 readonly 로 표시하면 유형 검사 중 쓸 수 없습니다.
interface SomeType {
  readonly prop: string;
}

function doSomething(obj: SomeType) {
  console.log(`prop has the value '${obj.prop}'.`);
  obj.prop = "hello"; // Error : Cannot assign to 'prop' because it is a read-only property

 /*
  obj.prop 에 대해서 읽을 수 있지만, 재 할당은 불가능하다. 
 */
}

readonly는 내부 내용을 변경할 수 없다는 의미는 아니며, 속성 자체를 다시 쓸 수 없음을 의미합니다.
interface Home {
  readonly resident: { name: string; age: number };
}

function visitForBirthday(home: Home) {
  console.log(`Happy birthday ${home.resident.name}!`);
  home.resident.age++; // 업데이트 가능
}

function evict(home: Home) {
 // Error: Cannot assign to 'resident' because it is a read-only property.
  home.resident = {
    name: "Victor the Evictor",
    age: 42,
  };
}

위 예제에서 보면 readonly 사용 시,
visitForBirthday() 에서 home.resident 속성을 읽은 후 업데이트가 가능하지만
evict() 에서는 속성 자체에 다시 쓸 수 없기 때문에 에러가 나는 것을 볼 수 있습니다.
추가적으로 readonly 는 생각보다 얕게 동작하여 참조하고 있는 값 자체는 변경될 수 없지만 그 안에 있는 속성들이 모두 동일 접근 제어자를 가지고 있는 것이 아니다.
type readonlyA = {
 readonly fooA: string
};
type readonlyB = {
 readonly barB: {bob: string};
}

const x: readonlyA = {fooA: 'foo'};
x.fooA = 'boo'; // Error: 변경 불가

const y: readonlyB = {barB: {bob: 'rice'}};
x.barB.bob = 'pizza' // 변경 가능

정리하면 readonly 는

값의 속성을 읽기 전용으로 설정해준다.
함수가 매개변수로 받는 값을 변경없이 사용할 때 사용하기 적합하다.
개발자 관점에서 읽기 쉬운 코드로 만들어내기 용이하다.

Index Signatures
가끔 우리는 작업을 하다보면 type의 모든 이름을 알지 못하지만 값의 형태가 어떻게 되는지 알고 있을 때가 있습니다. 이를 위해 Index Signatures는  형식으로 key와 value를 명시적으로 사용하는 경우 사용됩니다.
interface StringArray {
  [index: number]: string;
}

const myArray: StringArray = getStringArray();
const secondItem = myArray[1]; // type: string
const secondItem = myArray[1.toSring()]; // type: string


💡 JavaScript 기초 리마인딩
JavaScript가 객체 인덱스 서명에 사용된 객체에 대해 toString() 을 호출한다.

let obj = {
  toString(){
    return 'Hello'
  }
}

let foo: any = {};

foo[obj.toString()] = 'World'; // TypeScript는 명시적으로 호출하게 강제함
foo[obj] = 'World'; // Error: 인덱스 서명은 string, number 이어야 한다.

즉, TypeScript에서도 마찬가지로 인덱스 서명은 반드시 string, number, symbols 이여야 합니다.
String index signature 는 index signature 구조 를 따라야한다. 이 말은 즉, 모든 속성이 반환 유형과 일치하도록 강제합니다.
interface Foo {
  [key: string]: number;
  x: number;
  y: number;
}

interface Bar {
  [key: string]: number;
  x: number;
  y: string; // Error: Property `y` must of of type number
}

/*
 Index Signatures 타입인 [key: string]: number를 사용하였으면,
 모든 멤버들은 key: string, value: number를 일치해야합니다.
 그래서 Bar['y']는 string type을 지정했으므로, 에러가 납니다.
 아래와 같이 union 타입으로 수정 시 에러는 해결됩니다.
*/

interface Bar {
  [key: string]: number | string;
  x: number;
  y: string; // Error: Property `y` must of of type number
}

Extending Types
클래스처럼 객체의 속성 및 구조로 다른 타입과 합치거나, 확장시킬 수 있다. 이로 인해 재 사용성 높은 컴포넌트로 나눌 때, 유연함을 제공해 줍니다.
interface Animal {
  kind: string;
 age: number;
}

interface Pig extends Animal {
  name: string;
}

const pig: Pig = {
 kind: 'Duroc',
 age: 3,
 name: 'piki'
}

Intersection Types
interface 를 사용하면 다른 유형을 확장하여 새로운 유형을 만들 수 있습니다. 기존 객체 유형을 결합하는데 사용되는 교차 유형으로 보면 되며 & 연산자를 사용하여 정의합니다. (교집합 타입 설정)
interface Colorful {
  color: string;
}
interface Circle {
  radius: number;
}

type ColorfulCircle = Colorful & Circle;

function draw(circle: ColorfulCircle) {
  console.log(`Color was ${circle.color}`);
  console.log(`Radius was ${circle.radius}`);
}

draw({ color: "blue", radius: 42 }); // Success

Extending Types vs Intersection Types
우리는 interface를 사용하면 extends 절을 사용하여 다른 유형을 확장하는 법과, Intersections 의 교차 유형의 & 연산자를 사용하여 확장 후 새로운 유형을 만들었던 것을 알아보았다. 둘은 그럼 어떤게 다른 것일까? 결론적으로 둘의 차이점은 두 유형에 모두 동일한 속성의 키를 가진 멤버가 처리되는 방식의 차이이다.
1. Extending Types
interface Parent {
  x: string | number;
}

interface Child1 extends Parent {
  x: string; // Success
}

interface Child2 extends Parent {
  x: string | number | boolean; // Error: boolean 유형
}


interface extends 할 interface 가 유사한 유형을 제한된다

extends 다른 예제를 살펴보자

interface NumberToStringConverter {
  convert: (value: number) => string;
}

interface BidirectionalStringNumberConverter extends NumberToStringConverter {
  convert: (value: string) => number;
}

위 코드는 에러가 난다. 위에서 설명했듯이 그 이유는 NumberToStringConverter 가 BidirectionalStringNumberConverter 와 동일한 키(key)를 사용하지만 호환되지 않는 값(value) 속성 유형이 호환되지 않기 때문이다. 값(value)과 값(value) 매개변수 유형이 호환되지 않는다는 메세지를 전달합니다. 추가적으로 정리하면 정적으로 알려진 멤버가 있는 유형에만 사용할 수 있다.
2. Intersection Types
interface Parent {
 x: string | number;
}

type Child1 = Parent & {
 x: string; // Success
}

type Child2 = Parent & {
 x: string | number | boolean; // Success
}


type 은 여러 유형을 확장하여 새로운 유형을 만들 수 있다(교차 유형)

intersection types 다른 예제를 보자
type NumberToStringConverter = {
  convert: (value: number) => string;
}

type BidirectionalStringNumberConverter = NumberToStringConverter & {
  convert: (value: string) => number;
}

type은 여러 유형을 확장하여 새로운 유형을 만들 수 있기 때문에 에러가 나지 않는다.
일반 객체 유형(Generic Object Types)
일반 객체 유형은 포함된 요소 유형과 독립적으로 작동하는 일종의 컨테이너 유형입니다. 때문에 다양한 데이터 유형에서 재 사용할 수 있도록 도와줍니다.
interface Box {
  contents: Type;
}

interface StringBox {
  contents: string;
}

let boxA: Box = { contents: "hello" };
boxA.contents; // type: string

let boxB: StringBox = { contents: "world" };
boxB.contents; // type: string

Box과 StringBox는 동일하게 작동합니다.
interface Box {
  contents: Type;
}

interface Apple {
  color: string;
}

type AppleBox = Box;

const appleBox: AppleBox = {
  contents: {
    color: 'red'
  }
}

box의 Type은 무엇이든 대체할 수 있는 점에서 재 사용이 가능하다.
generic functions를 활용하여, 오버로드를 완전히 피할 수 있다.
// 함수 오버로드 유형 사용 예시
function setContents(box: StringBox, newContents: string): void;
function setContents(box: NumberBox, newContents: number): void;
function setContents(box: BooleanBox, newContents: boolean): void;
function setContents(box: { contents: any }, newContents: any) {
  box.contents = newContents;
}

// 일반 개체 유형 사용 예시
function setContents(box: Box, newContents: Type) {
  box.contents = newContents;
}

코드가 오버로드를 사용했을 때와 generic functions를 사용했을 때가 훨씬 더 간결해 진것을 느낄 수 있다.
물론 인터페이스가 아닌 유형 별칭으로도 만들 수 있습니다.
type Box = {
  contents: Type;
};

인터페이스 와 달리 유형 별칭을 사용하면 더 많은 object types를 묘사할 수 있습니다.
type OrNull = Type | null; // type: Type | null

type OneOrMany = Type | Type[]; // type: Type | Type[]

type OneOrManyOrNull = OrNull>; // type: OneOrMany | null

type OneOrManyOrNullStrings = OneOrManyOrNull; // type: OneOrMany | null

배열 타입 유형(Array Type)
일반 객체 유형를 이해했으면 개념적인 부분들은 똑같으므로 예제로 대체한다.
interface Array {
  length: number;
  pop(): Type | undefined;
  push(...items: Type[]): number;
}

ReadonlyArray 유형
ReadonlyArray는 변경되어서는 안 되는 배열을 설명하는 특수 유형이다.
function doStuff(values: ReadonlyArray) {
  const copy = values.slice();
  console.log(`The first value is ${values[0]}`); // Success

  values.push("hello!"); // Error: 값 변경 불가
}

ReadonlyArray의 특징으로는 형식만 가리킨다. 만약 값과 함께 쓰였다면 에러가 납니다.
new ReadonlyArray("red", "green", "blue"); // Error: ReadOnlyArray인데 값으로 사용되고 있다.

아래와 같이 형식만 가리키면 사용 가능합니다.
const colorArr: ReadonlyArray = ["red", "green", "blue"];

여기서 제일 주의해야할 점은 Array 와 ReadonlyArray 간에 양방향이 아니다라는 점이다.
let x: readonly string[] = [];
let y: string[] = [];

x = y;
y = x; // Error: 'readonly String[]'은 'readonly' 이라 string[] 변수 유형에 할당 불가

readonly 대한 개념은 아래로 대체한다.
읽기 프로퍼티(readonly Properties)
Tuple 유형
Tuple 유형은 포함된 요소의 수, 특정 위치에 포함된 유형을 정확하게 파악하기 사용되는 또 다른  Array 유형입니다.
type StringNumberPair = [string, number];

function doSomething(pair: StringNumberPair) {
  const a = pair[0]; // type: string
  const b = pair[1]; // type: number
  // ...
}

doSomething(["hello", 42]);

위 예제를 보면 요소의 수는  pair[0], pair[1] 이고, 특정 위치로는 pair[0] 의 유형은 string이며, pair[1]의 유형은 number 입니다.
function doSomething(pair: [string, number]) {
  const c = pair[2]; // Error: 튜플 타입은 [string, number] 이고 length는 2인데 index 2는 없다.
}

Tuple 유형은 아래 interface 유형과 동일합니다.
type StringNumberPair = [string, number];

interface StringNumberPair {
  length: 2;
  0: string;
  1: number;
}

추가적으로 JavaScript의 배열 구조 분해 할당을 사용하여 Tuple 유형을 구조화 할 수 있습니다.
function doSomething(stringHash: [string, number]) {
  const [inputString, hash] = stringHash;

  console.log(inputString);
  console.log(hash);
}

Tuple 유형에 당연히 선택적 속성과 나머지 요소를 가질 수 있습니다.
type Either2dOr3d = [number, number, number?];

function setCoordinate(coord: Either2dOr3d) {
  const [x, y, z] = coord;

  console.log(`Provided coordinates had ${coord.length} dimensions`); // length: 2 | 3
}

/*
 첫 번째 요소는 string 타입
 두 번째 요소는 number 타입
 세 번째 요소는 boolean 타입의 배열 나머지 요소
*/
type StringNumberBooleans = [string, number, ...boolean[]];

/*
 첫 번째 요소는 string 타입
 두 번째 요소는 boolean 타입의 배열 나머지 요소
 세 번째 요소는 number 타입
*/
type StringBooleansNumber = [string, ...boolean[], number];

/*
 첫 번째 요소는 boolean 타입의 배열 나머지 요소 
 두 번째 요소는 string 타입
 세 번째 요소는 number 타입
*/
type BooleansStringNumber = [...boolean[], string, number];

나머지 매개변수 및 인수를 활용하여 기존에 배웠던 함수 유형을 보다 명시적으로 표현할 수 있습니다.
// 함수 유형
function readButtonInput(name: string, version: number, ...input: boolean[]) {
  // ...
}

// Tuple 형식
function readButtonInput(...args: [string, number, ...boolean[]]) {
  const [name, version, ...input] = args;
  // ...
}


💡 Tuple 유형은 “명백한” 규약 기반 API에 사용하기에 유용합니다.

readonly Tuple 유형
Tuple 유형의 readonly는 as const 를 사용하면 똑같이 readonly Tuple 유형으로 유추된다는 특징이 있습니다.
// 기본 readolny tuple 유형
function doSomething(pair: readonly [string, number]) {
  // ...
}

// as const를 사용하여 readonly tuple 유형을 구현
let point = [3, 4] as const;

function distanceFromOrigin([x, y]: [number, number]) { 
  return Math.sqrt(x ** 2 + y ** 2);
}

// readonly를 사용하지 않았지만, point 유형이 readonly[3, 4]로 유추 
distanceFromOrigin(point); 
/*
 Error: 
 point 유형은 [3, 4] 형태로 변하지 않는다.
 tuple 유형으로 자유로운 [number, number] 포인트 형태로 올 수 있기에
 요소가 변형되지 않는다는 것을 보장할 수 없기 때문에 에러가 난다.
*/

typescript/class.html.body:
Classes
TypeScript는 ES5에 도입된 Class를 지원합니다.
TypeScript도 타입 주석들과 기타 구문들을 사용하여 클래스와 다른 타입간의 관계를 표현할 수 있습니다.
Class Memebers
가장 기본 적인 클래스를 정의하는 방법입니다.
class Point { }

Fields
필드 선언은 클래스에 쓰기 가능한 공용 속성을 만듭니다.
class Point {
  x: number; // Error: 'x'는 초기화가 이루어 지지 않았으며, 생성자 할당이 이루어지지 않았다.
  y: number; // Error: 'y'는 초기화가 이루어 지지 않았으며, 생성자 할당이 이루어지지 않았다.
}

const pt = new Point();
pt.x = 0;
pt.y = 0;

위 구문에서 클래스 내에 Fields에 값을 할당하지 않거나 생성자 함수에 값을 할당하지 않을 경우 에러를 띄운다. 그 이유는 아래 옵션 때문이다.
--strictPropertyInitialization
클래스 필드 여부를 설정 하는 옵션인데 옵션 활성화 시 생성자에서 초기화를 해줘야한다.
방법 1 - 생성자에 직접 초기화
class Point {
  x: number;
  y: number;
  constructor() {
    this.x = 0;
    this.y = 0;
  }
}

const pt = new Point();
pt.x = 0;
pt.y = 0;

방법 2 - definite assignment assertion operator인 !를 사용
class Point {
  x!: string;
}

readonly
셍성자 외부 필드애 대한 할당을 방지하려면 readonly를 사용하면 됩니다.
class Point {
  readonly x: number = 0;
  constructor(pointX?: number) {
    if (pointX) {
      this.x = pointX;
    }
  }
}

const pt = new Point();
pt.x = 0; // Error: `readonly` 프로퍼티라 값 할당이 불가능

Constructors
클래스 생성자는 함수와 매우 유사합니다. 타입 주석(변수에 할당되는 값의 유형), 기본값 및 오버로드를 사용하여 매개 변수를 추가할 수 있습니다.
class Point {
  x: number;
  y: number;

  constructor(x = 0, y = 0) {
    this.x = x;
    this.y = y;
  }
}

class Point {
  // Overloads
  constructor(x: number, y: string);
  constructor(s: string);
  constructor(xs: any, y?: any) { }
}

클래스 생성자 시그니처들과 함수 시그니처 사이에는 차이점이 있습니다.

생성자는 타입 파라미터를 받을 수 없다(외부 클래스 선언에 속함)
생성자는 리턴 타입 주석(type annotation(let num: number))을 가질 수 없습니다. (클래스 인스턴스 유형은 어떤 것이든 항상 반환됨)

Super
기본 Class 문법과 동일하게 상속 시에 상속 받은 클래스에 super()를 불러 온 후 this로 접근할 수 있습니다.
class Person {
  name: string;
  location: string;
  constructor() {
    this.name = '';
    this.location = '';
  }
}

class Park extends Person {
  computer: number;
  constructor() {
    this.computer = 2; // Error: 자식 클래스 생성자에서는 super() 먼저 쓴 이후 this를 호출할 수 있다.
    super();
  }
}

Method
메서드는 함수 및 행성자와 동일한 type annotations를 사용할 수 있습니다.
class Point {
  x = 10;
  y = 10;

  scale(n: number): void {
    this.x *= n;
    this.y *= n;
  }
}

type annotations 외에 TypeScript 에서는 다른 새로운 것을 추가하지 않습니다.
추가적으로 메서드내에서 변수 접근 시 꼭 this를 사용해야한다.
let x: number = 0;

class C {
  x: string = "hello";
  m() {
    /*
      Error:
      클래스 프로퍼티가 아닌 전역 변수 x를 가리킨다.
      그러므로 x는 number인데, string을 넣으려고 하니 number를 에러
    */
    x = "world";
  }
}

Getter / Setter
TypeScript 에서는 특별한 엑세스 권한 규칙이 존재합니다.

만약 get이 존재하지만 set이 존재하지 않을 경우 프로퍼티는 자동적으로 readonly가 됩니다.
만약 setter 파라미터가 지정되지 않았을 경우, getter에서 반환 유형이 유추됩니다.
getter와 setter는 반드시 동일한 Member Visibility를 가져야 한다.


추가적으로 로직에 타입 추론 상 추가 논리가 필요없는 경우에는 getter, setter를 사용 안 해도 된다.

class C {
  _length = 0;
  get length() {
    return this._length;
  }
  set length(value) {
    this._length = value;
  }
}

TypeScript 4.3 부터는 getter와 setter 설정 시 다른 접근자를 가질 수 있습니다.
class Thing {
  _size = 0;

  get size(): number {
    return this._size;
  }

  set size(value: string | number | boolean) {
    let num = Number(value);

    if (!Number.isFinite(num)) { // NaN, Infinity 등을 허용하지 않음
      this._size = 0;
      return;
    }
    this._size = num;
  }
}

Index Signatures
클래스는 인덱스 서명(Index Signatures)을 사용할 수 있습니다.
class MyClass {
  [s: string]: boolean | ((s: string) => boolean);

  check(s: string) {
    return this[s] as boolean;
  }
}

하지만 클래스 인덱스 서명 같은 경우에는 메소드 유형도 맞춰야 하므로 유용하게 사용하기 쉽지 않습니다.

인덱싱된 데이터를 클래스 인스턴스가 아닌 다른 위치에 저장 시키는게 더 낫다.

Class Heritage
객체 지향 기능이 있는 다른언어와 마찬가지로 상속이 가능하다.
implements Clauses
implements 를 사용해서 클래스가 특정 interface를 충족하는데 체크할 수 있습니다.
interface Pingable {
  ping(): void;
}

interface Pongable {
  pong(): void;
}

// 아래처럼 합쳐서 상속할 수 있다.
class Sonar implements Pingable, Pongable {
  ping() {
    console.log('ping!');
  }
  pong() {
    console.log('pong');
  }
}

주의 사항
implements는 클래스의 인터페이스 유형으로 취급될 수 있는지 체크하는 의도일 뿐 클래스 type이나 method 를 변경하지 않습니다. implements 를 사용하면서 주요 오류 원인은 클래스 type을 바꾸려다가 에러가 많이 발생합니다.
interface Checkable {
  check(name: string): boolean;
}

class NameChecker implements Checkable {
  check(s) { // Error: 매개변수 's'는 암시적으로 'any' 유형을 갖습니다.
    return s.toLowerCase() === "ok";
  }
}

implements을 사용 시 클래스 본문이 검사되는 방식이나 type이 추론되는 방식을 변경하지 않습니다.
interface A {
  x: number;
  y?: number;
}
class C implements A {
  x = 0;
}
const c = new C();
c.y = 10; // Error: 'y'는 type 'c'에 존재하지 않는다.

extends Clauses
클래스는 기본 클래스를 확장시킬 수 있습니다. 파생된 클래스는 기본 클래스의 모든 프로피티와 메서드를 가지며, 추가 멤버를 정의할 수 있습니다.
class Animal {
  move() {
    console.log("Moving along!");
  }
}

class Dog extends Animal {
  woof(times: number) {
    for (let i = 0; i 
Overriding Methods
Derived 클래스는 Base 클래스 필드 또는 속성을 재 정의할 수 있습니다. 구문을 사용하여 Base 클래스 메서드에 엑세스 할 수 있으며, JavaScript 클래스는 단순한 조회 객체이므로 super field 라는 개념이 없다는 것을 인지해야 합니다.
TypeScript는 Derived 클래스가 항상 기본 클래스의 하위 유형임을 강제합니다.
class Base {
  greet() {
    console.log("Hello, world!");
  }
}

class Derived extends Base {
  greet(name?: string) {
    if (name === undefined) {
      super.greet();
    } else {
      console.log(`Hello, ${name.toUpperCase()}`);
    }
  }
}

const d = new Derived();
d.greet();
d.greet("reader");

Derived 클래스는 Base 클래스를 따르는 것이 중요합니다. Base 클래스 참조를 통해 Derived 클래스 인스턴스를 참조한다 라는 것을 꼭 기억해야합니다.
// `Base` 클래스 참조를 통해 `Derived` 인스턴스의 별칭을 지정한다.
const b: Base = d;
b.greet(); // Success

type 전용 필드 선언
필드 선언에 대한 런타임 효과가 없어야 함을 TypeScript 에서 나타내기 위해서는 declare을 작성할 수 있습니다.

target >= ES2022 또는 useDefineForClassFields 값이 True인 경우 클래스 필드는 상위 클래스 생성자가 완료된 후 초기화 되어 상위 클래스에서 설정한 값을 덮어씁니다.

interface Animal {
  dateOfBirth: any;
}

interface Dog extends Animal {
  breed: any;
}

class AnimalHouse {
  resident: Animal;
  constructor(animal: Animal) {
    this.resident = animal;
  }
}

class DogHouse extends AnimalHouse {
// 자바스크립트 코드를 내보내지 않으며, type이 올바른지만 체크합니다.
  declare resident: Dog;
  constructor(dog: Dog) {
    super(dog);
  }
}

Initilization Order
JavaScript 클래스가 초기화 하는 순서는 경우에 따라 의외가 생길 수 있습니다.
class Base {
  name = "base";
  constructor() {
    console.log("My name is " + this.name);
  }
}

class Derived extends Base {
  name = "derived";
}

const d = new Derived(); // base가 출력

JavaScript에서 클래스 초기화 순서는 아래와 같습니다.

Base 클래스 필드가 초기화됩니다.
Base 클래스 생성자가 실행됩니다.
Derived 클래스 필드가 초기화됩니다.
Derived 클래스 생성자가 실행됩니다.

이 말은 즉, Derived 클래스 필드 초기화가 아직 실행되지 않았기 때문에 Base 클래스 생성자 중 이름에 대한 자체 값을 확인했다는 의미입니다.
Built-in Types 상속(ES6 / ES2015 이상으로 설정되어 있어 패스)
Member Visibility
TypeScript를 사용하여 특정 메서드 또는 클래스 외부의 코드에 표시되는지 여부를 제어할 수 있습니다.
Public
클래스 맴버의 기본 가시성은 어디에서나 엑세스 가능한 public 입니다.
class Greeter {
  public greet() {
    console.log("hi!");
  }
}
const g = new Greeter();
g.greet();

Protected
protected 멤버는 선언된 클래스의 하위 클래스만 볼 수 있다.
class Greeter {
  public greet() {
    console.log("Hello, " + this.getName());
  }
  protected getName() {
    return "hi";
  }
}

class SpecialGreeter extends Greeter {
  public howdy() {
    // 여기에서 보호 된 구성원에 액세스 할 수 있습니다.
    console.log("Howdy, " + this.getName());
  }
}
const g = new SpecialGreeter();
g.greet(); // OK
g.getName();

Exposure of protected members
상속된 하위 클래스는 상위 클래스를 따라야하지만 기본 클래스의 하위 유형을 노출할 수 있도록 따로 설정도 가능합니다. protected된 멤버도 public처럼 엑세스 할 수 있습니다.
class Base {
  protected m = 10;
}
class Derived extends Base {
  m = 15; // 기본 설정은 public
}
const d = new Derived();
console.log(d.m); // Success: 15

Derived 클래스는 기본으로 설정되는 public 설정으로 인해 protected가 의미 없게 변경될 수 있습니다. Derived 클래스에서 protected가 의도적으로 노출되지 않도록 주의해야합니다.
Cross-hierarchy protected access
Base 클래스 참조를 통해 보호된 x에 엑세스 하는 것이 가능한지 여부에 따라 다른 OOP 언어가 동의하지 않습니다.
class Base {
  protected x: number = 1;
}
class Derived1 extends Base {
  protected x: number = 5;
}
class Derived2 extends Base {
  f1(other: Derived2) {
    other.x = 10;
  }
  f2(other: Base) {
    other.x = 10; 
    /*
      Error:
      속성 'x'는 'protected' 있으며 'Derived2' 클래스의 인스턴스를 통해서만 액세스할 수 있습니다. 'x'는 'Base' 클래스의 인스턴스입니다.
    */
  }
}

Java는 이를 합법적인 것으로 간주하지만, C#과 C++은 이 코드를 불법으로 간주합니다.
Derived2에서 x에 엑세스 하는 것은 Derived2의 서브 클래스부터만 합법적이어야 하고 Derived1은 서브 클래스에 속하지 않기 때문에 TypeScript는 C#과 C++ 처럼 불법으로 간주합니다. Derived1 참조를 통해 x에 엑세스하는 것이 불법이라면, Base 클래스 참조를 통해 엑세스 한다고 해서 상황이 개선되는 건 아닙니다.
Private
Protected와 같지만, 하위 클래스에서도 멤버에 대한 엑세스를 허용하지 않습니다.
class Base {
  private x = 0;
}
const b = new Base();

console.log(b.x);
// Error: 'private' 속성으로 인해 'Base' 클래스 안에서만 접근이 가능하다.

class Derived extends Base {
  showX() {
    console.log(this.x); 
    // Error: 서브 클래스에서도 접근이 불가능하다.
  }
}

private 멤버가 Derived 클래스에 표시되지 않으면 Derived 클래스는 가시성을 높일 수 없습니다.
class Base {
  private x = 0;
}
class Derived extends Base {
  x = 1;
  // Error: Base Class에 멤버변수 'x'를 'private'로 설정해 놓고 여기서는 'public'으로 설정하면 안 된다는 에러
}

Cross-instance private access
같은 클래스의 서로 다른 인스턴스가 서로의 private 멤버에 엑세스 할 수 있을지에 대해서 객체지향 언어마다 의견이 다릅니다.Java, C##, C++, Swift, PHP와 같은 언어에서는 허용하지만 Ruby에서는 허용허지 않습니다.
TypeScript는 인스턴스 간 비공개 엑세스를 허용합니다.
class A {
  private x = 10;

  public sameAs(other: A) {
    return other.x === this.x; // Success
  }
}

주의사항
TypeScript 타입 시스템의 다른 측면과 마찬가지로 private와 protected는 타입 검사 중에만 적용됩니다.
이 말은 즉, in 또는 단순 속성 조회와 같은 JavaScript 런타임 구문은 private와 protected 멤버에 엑세스 할 수 있습니다.
JavaScript
class MySafe {
  private secretKey = 12345;
}

const s = new MySafe();
console.log(s.secretKey); // Success: 12345

private는 type 검사 중 대괄호([]) 기법을 사용하여 엑세스를 허용할 수 있습니다. 이렇게 되면 private로 선언된 필드가 단위 테스트 같은 항복에 대해 잠재적으로 쉽게 엑세스할 순 있으나 soft private이고 개인 정보를 엄격하게 다루지는 못합니다.
class MySafe {
  private secretKey = 12345;
}
const s = new MySafe();

console.log(s.secretKey); // Error: private으로 접근 불가능
console.log(s['secretKey']); // Success: 대괄호 기법으로 엑세스 가능


private와 달리 JavaScript에서  private는 컴파일 후 비공개로 유지되며, 방금 언급한 대괄호 표기법([]) 엑세스와 같이 soft private로 만들기 위한 어떠한 것도 제공하지 않으므로 hard private 입니다.

Static 클래스의 정적 블록
클래스는 정적 멤버가 있을 수 있습니다. 이러한 정적 멤버는 클래스의 특성 인스턴스와 연관 되지 않습니다. 클래스 생성자 객체 자체를 통해 엑세스 할 수 있습니다.
class MyClass {
  static x = 0;
  static printX() {
    console.log(MyClass.x);
  }
}
console.log(MyClass.x);
MyClass.printX();

Static도 마찬가지로 public, protected, private 접근 제어자를 사용할 수 있습니다.
class MyClass {
  private static x = 0;
}
console.log(MyClass.x);
// Error: 'x'는 'MyClass' 내에서만 엑세스 할 수 있습니다.

당연히 상속도 가능합니다.
class Base {
  static getGreeting() {
    return "Hello world";
  }
}
class Derived extends Base {
  myGreeting = Derived.getGreeting();
}

특수 Static 이름들
일반적으로 함수 프로토타입에서 프로퍼티를 덮어쓰는 것은 매우 안 좋은 행동입니다. 클래스는 그 자체적으로 함수를 호출할 수 있는 함수이기 때문에 new 또는 특정 static 이름들에는 사용할 수 없습니다. name, length, call과 같은 함수 속성은 Static 멤버에 정의할 수 없습니다.
class S {
  static name = "S!";
  // Error: Static 속성 'name'이 생성자 함수 'S'의 내장 속성 'name'과 충돌한다라는 에러

Static 클래스가 없는 이유는 무엇일까요?
TypeScript에는 C#과 같은 방식으로 static class 라는 구성이 없습니다.
이러한 구조는 해당 언어가 모든 데이터와 함수를 클래스 내부에 강제로 포함하기 때문입니다. TypeScript에는 해당 제한 사항이 없으므로 필요하지 않습니다. 인스턴스가 하나인 클래스는 일반적으로 JavaScript/TypeScript에서 일반 객체로 표현됩니다.
예를 들어 일반 객체로도 충분히 작업을 수행할 수 있습니다. 그러므로 TypeScript는 static class가 필요하지 않습니다.
// 불필요한 '정적' 클래스
class MyStaticClass {
  static doSomething() {}
}

// 방법 1
function doSomething() {}

// 방법 2
const MyHelperObject = {
  dosomething() {},
};

static 클래스의 블록
Static block을 사용하면 클래스 내의 비공개 필드에 엑세스 할 수 있는 자체 범위가 있는 일련의 명령문을 작성할 수 있습니다. 이 명령문은 작성할 수 있는 모든 기능을 갖춘 초기화 코드를 작성할 수 있고, 변수가 노출되지 않으며, 클래스 내부에 대한 전체 엑세스 권한이 있습니다.
class Foo {
    static #count = 0;

    get count() {
        return Foo.#count;
    }

    static {
        try {
            const lastInstances = loadLastInstances();
            Foo.#count += lastInstances.length;
        }
        catch {}
    }
}

Generic Classes
interface와 마찬가지로 클래스도 Generic이 될 수 있다. Generic Class는 new를 사용하여 인스턴스화되면 해당 type 매개변수는 함수 호출에서만 동일한 방식으로 추론됩니다.
class Box {
  contents: Type;
  constructor(value: Type) {
    this.contents = value;
  }
}

const b = new Box("hello!");

class는 interface와 동일한 방식으로 generic constraints(일반 제약 조건) 또는 기본 값을 사용할 수 있습니다.
정적 멤버의 type 매개 변수
아래 코드는 합법적이지 않으며, 그 이유가 명확하지 않습니다.
class Box {
  static defaultValue: Type;
  // Error: static 멤버는 클래스 유형 매개 변수를 참조할 수 없습니다.
}

type은 항상 완전히 지워집니다. 런타임에서 Box.defaultValue 속성 슬롯이 하나만 있습니다. 이는 Box.defaultValue를 설정하면 Box.defaultValue도 변경 된다는 것을 의미(매우 좋지 않음)합니다. Generic Class의 static 멤버는 클래스 형식의 매개 변수를 참조할 수 없습니다.
클래스 런타임에 this
TypeScript는 JavaScript의 런타임 동작을 변경하지 않으며, JavaScript는 몇 가지 특이한 런타임 동작이 있는 것으로 유명하다는 점을 기억하는 것이 좋습니다.
JavaScript는 이를 처리하는 방식은 특이합니다.
class MyClass {
  name = 'MyClass';
  getName() {
    return this.name;
  }
}
const c = new MyClass();
const obj = {
  name: 'obj',
  getName: c.getName,
};

console.log(obj.getName()); // obj

this는 함수 호출 방식에 따라 결정됩니다. obj 참조를 통해 함수가 호출되었으므로 this는 클래스 인스턴스가 아닌 obj입니다.
TypeScript는 이러한 종류의 오류를 완화하거나 방지할 수 있는 몇 가지 방법을 제공합니다.
1. Arrow Functions
this context를 잃는 방식으로 자주 호출되는 함수가 있을 경우 메서드 정의 대신 Arrow Functions 속성을 사용하는 것이 합리적이다.
class MyClass {
  name = "MyClass";
  getName = () => {
    return this.name;
  };
}
const c = new MyClass();
const g = c.getName;

console.log(g()); // MyClass

여기에는 몇 가지 단점이 있습니다.

this 값은 TypeScript로 검사되지 않은 코드의 경우 런타임에서 괜찮다고 생각합니다.
각 클래스 인스턴스는 이런 식으로 정의된 각 함수의 자체 복사본을 갖기 때문에 더 많은 메모리를 사용합니다.
prototype chain을 통해 기본 클래스에서 메서드를 가져올 수 없기 때문에 전달된 클래스에서 super.getName을 사용할 수 없습니다.

this 파라미터
매서드 또는 함수 정의에서 초기 매개변수 this는 TypeScript에서 특별한 의미를 갖습니다. 이러한 매개변수는 JavaScript 컴파일 중에 사라집니다.
// TypeScript 'this' 파라미터를 넣었을 경우
function fn(this: SomeType, x: number) {
  /* ... */
}

// JavaScript에서는 컴파일 중에 사라집니다.
function fn(x) {
  /* ... */
}

TypeScript는 this 매개변수가 있는 함수를 호출할 때 올바른 컨텍스트에서 호출되는지를 확인합니다. 화살표 함수를 사용하는 대신 메서드 정의에 this 매개변수를 추가하여 메서드가 올바르게 호출되도록 정적으로 강제할 수 있습니다.
class MyClass {
  name = "MyClass";
  getName(this: MyClass) {
    return this.name;
  }
}
const c = new MyClass();
// Success
c.getName();

// Error, would crash
const g = c.getName;
console.log(g());
// Error: 'void' 타입의 `this` 컨텍스트는 'MyClass' 타입의 메서드 'this'에 할당할 수 없습니다.

이 방법은 Arrow function 방식과 반대되는 장단점을 가지고 있습니다.

JavaScript 호출자가 인식하지 못한 채 클래스 메서드를 잘못 사용할 수 있습니다.
클래스 인스턴스당 함수가 하나씩 할당되는 것이 아닌 클래스 정의당 하나의 함수만 할당 됩니다.
기본 베서드 정의는 여전히 super를 통해 호출할 수 있습니다.

this Types
특별한 타입인 this는 현재 클래스 타입을 동적으로 참조합니다. 이것을 어떻게 활용할지 살펴보자!
class Box {
  contents: string = '';
  // (method) Box.set(value: string): this
  set(value: string) {
    this.contents = value;
    return this;
  }
}

여기서 TypeScript는 집합의 return 유형을 Box가 아닌 this로 추론 했습니다. box의 서브클래스를 만들어 봅시다.
class ClearableBox extends Box {
  clear() {
    this.contents = "";
  }
}

const a = new ClearableBox();
const b = a.set("hello"); // b type: ClearableBox

parameter type annotation에서도 사용할 수 있습니다.
class Box {
  content: string = '';
  sameAs(other: this) {
    return other.content === this.content;
  }
}

이것은 other: Box과 작성하는 것과 다릅니다. 만약 파생 클래스가 있는 경우 메서드는 이제 동일한 파생 클래스의 다른 인스턴스만 허용합니다.
class Box {
  content: string = "";
  sameAs(other: this) {
    return other.content === this.content;
  }
}

class DerivedBox extends Box {
  otherContent: string = "?";
}

const base = new Box();
const derived = new DerivedBox();
derived.sameAs(base);
/*
  Error: 'Box' 타입의 인수를 'DerivedBox' 타입의 매개변수 유형에 할당할 수 없습니다.
  'Box' 타입에는 'DerivedBox' 타입의 'otherContent' 속성이 필요합니다.
*/

this 기본 타입 가드
Class 및 Interface의 메서드 반환 위치에서 this is Type을 사용할 수 있습니다. Type Narrowing과 혼합하면 대상 객체의 타입이 지정된 타입으로 좁혀 집니다.
class FileSystemObject {
  isFile(): this is FileRep {
    return this instanceof FileRep;
  }
  isDirectory(): this is Directory {
    return this instanceof Directory;
  }
  isNetworked(): this is Networked & this {
    return this.networked;
  }
  constructor(public path: string, private networked: boolean) {}
}

class FileRep extends FileSystemObject {
  constructor(path: string, public content: string) {
    super(path, false);
  }
}

class Directory extends FileSystemObject {
  children: FileSystemObject[];
}

interface Networked {
  host: string;
}

const fso: FileSystemObject = new FileRep("foo/bar.txt", "foo");

if (fso.isFile()) {
  fso.content; // type: FileRep

} else if (fso.isDirectory()) {
  fso.children; // type: Directory

} else if (fso.isNetworked()) {
  fso.host; // type: Networked & FileSystemObject
}

이 기반의 타입 가드의 일반적인 사용 사례는 특정 필드에 대한 지연 유효성을 검사를 허용하는 것이다. 예를 들어 hasValue가 참인 것으로 확인되면 상자 안에 있는 값에서 정의되지 않은 값을 제거합니다.
class Box {
  value?: T;

  hasValue(): this is { value: T } {
    return this.value !== undefined;
  }
}
const box = new Box();
box.value = "Gameboy";
box.value; // (property) Box.value?: unknown

if (box.hasValue()) {
  box.value; // (property) value: unknown
}

매개변수 속성들
TypeScript는 생성자 매개변수를 동일한 이름과 값을 가진 클래스 속성으로 변환하는 특수 구문을 제공합니다. 이를 parameter propertis라고 부르며, 생성자 인수 앞에 public, private, protected, readonly 중 하나를 생성자 인수에 접두사로 지정하여 생성합니다. 결과 필드는 해당 수정자를 가져옵니다.
class Params {
  constructor(
    public readonly x: number,
    protected y: number,
    private z: number
  ) { }
}
const a = new Params(1, 2, 3);
console.log(a.x); // (property) Params.x: number
console.log(a.z); // Error: 'z'는 'private 속성으로 클래스 'Params'에서만 접근이 가능하다.

클래스 표현식
클래스 표현식은 클래스 선언과 매우 유사하다. 유일한 차이점은 클래스 표현식에는 이름을 필요로 하지 않지만, 바인딩된 식별자를 통해 참조할 수 있습니다.
const someClass = class {
  content: Type;
  constructor(value: Type) {
    this.content = value;
  }
};

const m = new someClass("Hello, world"); // type: someClass

abstract 클래스들과 맴버들
TypeScript`의 클래스, 메서드 및 필드는 추상적일 수 있습니다.
추상 메서드나 추상 필드는 구현이 제공되지 않은 메서드나 필드입니다. 이러한 멤버는 직접 인스턴스화할 수 없는 추상 클래스 내부에 존재해야 합니다.
추상 클래스의 역할은 모든 추상 멤버를 구현하는 서브클래스의 기본 클래스 역할을 하는 것입니다. 클래스에 추상 멤버가 없는 경우 구상(Concrete) 클래스이다.

구상 클래스: new 키워드로 객체를 생성할 수 있는 클래스

abstract class Base {
  abstract getName(): string;

  printName() {
    console.log("Hello, " + this.getName());
  }
}

const b = new Base(); // Error: 아무 인스턴스 없이 추상 클래스를 생성할 수 없다.

Base는 추상적이기 대문에 new로 인스턴스화 할 수 없습니다. 방법은 파생 클래스를 만들고 추상 멤버를 구현해야합니다.
class Derived extends Base {
  getName() {
    return "world";
  }
}

const d = new Derived();
d.printName();

기본 클래스의 추상 멤버를 구현하는 것을 잊어버리면 오류가 발생합니다.
class Derived extends Base {
  /*
    만약 여기에 추상 멤버를 구현하지 않는다면!!!

    Error: 추상적이지 않은 클래스 'Derived'는 'Base' 클래스에서 상속된 추상 멤버 'getName'을 구현하지 않았습니다.
  */
}

추상 Construct Signatures
어떤 추상 클래스에서 파생된 클래스의 인스턴스를 생성하는 클래스 생성자 함수를 받아들이고 싶을 때가 있습니다.
function greet(ctor: typeof Base) {
  const instance = new ctor();

  // Error: 추상 클래스에 아무런 인스턴스를 생성하지 않았습니다.
  instance.printName();
}

TypeScript는 추상 클래스를 인스턴스화 하려고 한다는 것을 올바르게 알려줍니다. 즉, greet의 정의를 고려할 때 이 코드를 작성하는 것은 맞는 방법이며, 결국 추상 클래스를 구성하게 됩니다.
// Bad!
greet(Base);

construct signature을 가진 무언가를 받아들이는 함수를 작성하려고 합니다.
function greet(ctor: new () => Base) {
  const instance = new ctor();
  instance.printName();
}
greet(Derived);
greet(Base); 
/*
  Error: 'type Base' 타입의 인수는 'new () => Base' 타입의 매개 변수에 할당할 수 없습니다. 추상 생성자 타입을 추상적이지 않은 생성자 타입에 할당이 불가능합니다.
*/

TypeScript는 어떤 클래스 생성자 함수를 호출할 수 있는지 정확하게 알려줍니다. Derived는 구체적이기 때문에 호출할 수 있지만 Base는 호출할 수 없습니다.
클래스들 사이 관계
대부분의 경우 TypeScript의 클래스는 다른 타입들과 동일하게 구조적으로 비교됩니다.
예를 들어 아래 두 클래스는 동일하기 때문에 서로 대신 사용할 수 있습니다.
class Point1 {
  x = 0;
  y = 0;
}

class Point2 {
  x = 0;
  y = 0;
}

const p: Point1 = new Point2(); // Success

마찬가지로 명시적인 상속이 없더라도 클래스 간의 하위 타입 관계를 존재합니다.
class Person {
  name: string;
  age: number;
}

class Employee {
  name: string;
  age: number;
  salary: number;
}

const p: Person = new Employee(); // Success

간단해 보일 수 있지만 매우 낯설게 느껴지는 경우가 몇 가지 있습니다.

빈 클래스에는 멤버가 없습니다.
구조적 타입 시스템에서 멤버가 없는 타입은 일반적으로 다른 타입의 상위 타입이다.

따라서 빈 클래스를 작성하지마세요!
class Empty {}

function fn(x: Empty) {
  // 이런거 작성하지 마세요!
}

// All OK!
fn(window);
fn({});
fn(fn);

typescript/type-manipulation/generics.ht.body:
Generics - 매개변수를 받는 타입
Generics 같은 경우에는 TypeScript 주제 중 More on Functions 와 Object Types 에 예제로 나오기도 했지만, 개념적으로 접근해보면 설명하면 한 가지 타입보다 여러 가지 타입에서 동작하는 재사용성이 높은 컴포넌트를 만들 때 자주 사용됩니다.
function identity(arg: T): T{
  return arg;
}

let output = identity("myString"); // 첫 번째 방법 - type: string
/*
 원래는 위와 방법도 호출이 가능하지만, 앞서 배운 타입 추론을 통해 두 번째 방법 같이 더 가독성 있게 간단히 사용할 수 있습니다. 
 여기서의 핵심은 TypeScript는 컴파일러 값인 "myString"을 보고 타입 추론을 하여 Type을 정합니다. 
 (더 복잡한 예제에서는 컴파일러가 타입을 유추하기 어려울 때는 첫 번째 방법처럼 명시적으로 타입을 지정해 줘야한다)
*/

let output = identity("myString"); // 두 번째 방법 -  type: string

위와 같이 우리는 타입 변수인 Type을 통해 전달하는 인수에 따라서 컴파일러가 Type 값을 자동으로 정하게 해준다.
제네릭 타입 변수 작업
제네릭을 사용하면 컴파일러가 함수 본문에 제네릭 타입화된 매개변수를 사용하도록 강요합니다.
function loggingIdentity(arg: T): T{
  console.log(arg.length); // Error: Type에는 length가 없습니다.
  return arg;
}

위 예제를 보면 제네릭 타입을 사용 시 any나 모든 타입을 의미하는데, .length 가 없는 number 를 대신 전달할 수도 있습니다. 그러한 경우 number에는 length가 없기 때문에 Type 에러가 납니다.
그럼 다른 예제를 보자.
function loggingIdentity(arg: T[]): T[] {
  console.log(arg.length); // Success 배열 프로토타입에는 length가 있기 때문에
  return arg;
}

function loggingIdentity(arg: Array): Array {
  console.log(arg.length); // Success: 배열 프로토타입에는 length가 있기 때문에
  return arg;
}

위 함수는 일반 Type이 아닌 Type의 배열에서 동작했다고 가정한 예시이다. loggingIdentity의 타입을 정리해보면 아래와 같다.

제네릭 함수 loggingIdentity는 타입 매개변수 Type과 Type 배열인 인수 arg를 가지며, Type 배열을 반환한다.

제네릭 타입
함수 자체의 타입과 제네릭 인터페이스를 만드는 법에 대해 알아보자.
function identity(arg: T): T {
  return arg;
}

let myIdentityFirst: (arg: Input) => Input = identity; // 첫 번째 방법
let myIdentitySecond: { (arg: T): T } = identity; // 두 번째 방법

위 코드를 아래 인터페이스 코드로 작성할 수 있습니다.
interface GenericInfinityFn {
 (arg: T): T;
}

function identity(text: T>: T {
 return arg;
}

let myIndentity: GenericInfinityF = identity;

만약 컴파일러가 타입을 유추하기 어렵거나 인자 타입을 강조하고 싶다면 다시 인자 타입을 강조할 수 있습니다.
interface GenericInfinityFn {
 (arg: T): T;
}

function identity(text: T>: T {
 return arg;
}

let myIndentity: GenericInfinityFnn = identity;

이와 같은 방식으로 제네릭 인터페이스 뿐 아니라 클래스도 생성 가능합니다.
제네릭 클래스
제네릭 클래스도 마찬가지로 제네릭 인터페이스와 형태가 비슷합니다.
제네릭 클래스의 특징으로는 클래스 이름 뒤에 <> 안쪽에 제네릭 타입 매개변수 목록을 가집니다. 해당 클래스로 인스턴스 생성 시 타입에 어떤 값이 들어갈지 지정해 주면 됩니다.
 class GenericNumber {
  zeroValue: T;
  add: (x: T, y: T) => T;
} // 제네릭 클래스

let myGenericNumber = new GenericNumber(); // type: number로 지정
myGenericNumber.zeroValue = 0;
myGenericNumber.add = function (x, y) {
  return x + y;
};

클래스는 두 가지 타입을 가집니다.

정적 측면
인스턴스 측면

제네릭 클래스는 정적 측면이 아닌 인스턴스 측면에서만 제네릭이므로, 클래스 작업 시 정적 멤버 클래스는 타입 매개변수에 쓸 수 없습니다.
제네릭 제약조건
제네릭 함수에서 타입 추론을 할 수 있게 힌트를 줄 수 있습니다.
function loggingIdentity(arg: T): T{
  console.log(arg.length); // Error: Type에는 length가 없습니다.
  return arg;
}

위 예제를 보면 T 가 어떤 타입인지 정의되지 않았기에 Error가 납니다. 이럴 경우 해당 타입을 정의하지 않고도 제약 조건을 걸어 타입에 제약을 걸 수 있습니다.
interface Lengthwise {
  length: number;
}

function loggingIdentity(arg: T): T {
  console.log(arg.length); // Type: length 프로퍼티를 가진 Type
  return arg;
}

loggingIdentity(3); // Error: Number Type에는 'length'가 존재하지 않음
loggingIdentity({ length: 10, value: 3 }); // Success: 'arg.length' 코드는 속성 접근과 같이 동작하므로 성공

객체의 속성을 제약하는 방법
이름이 있는 객체에서 프로퍼티를 가져오고 싶은 경우, 다른 타입 매개변수로 제한된 타입 매개변수를 선언할 수 있습니다.
function getProperty(obj: T, key: Key) {
  return obj[key];
}

let x = { a: 1, b: 2, c: 3, d: 4 }; // type: 'a' | 'b' | 'c' | 'd'

getProperty(x, "a"); // Success: 타입 해당
getProperty(x, "m"); // Error: 타입에 'm'은 없습니다.

typescript/type-manipulation/keyof-type-.body:
Keyof Type Operator - 키 타입 연산자를 사용하여 새 타입 만들기
Keyof 타입 연산자
keyof 연산자는 객체 타입에서 객체의 키값들을 숫자나 문자열 리터럴 유니온 을 생성합니다.
type Point = { x: number; y: number };
type P = keyof Point; // type: 'x' | 'y' 와 동일한 타입

만약 타입이 string이나 number 인덱스를 시그니쳐를 가지고 있다면, keyof는 해당 타입을 리턴합니다.
type Arrayish = { [n: number]: unknown };
type A = keyof Arrayish; // type: number

type Mapish = { [k: string]: boolean };
type M = keyof Mapish; // type:  객체 키는 항상 문자열(toString())을 강제하기에 string | number | symbol

typescript/type-manipulation/Indexed-acc.body:
Indexed Access Types - Type[’a’] 구문을 사용한 유형의 하위 집합 엑세스
typeof 타입 연산자
JavaScript 에서는 표현식 컨텍스트에서 사용할 수 있는 typeof 연산자가 있으며, TypeScript 에서는 타입 컨텍스트에서 변수나 프로퍼티 타입을 추론할 수 있는 typeof 연산자가 있습니다.
// JavaScript
console.log(typeof "Hello world"); // string

// TypeScript
let s = "hello";
let n: typeof s; // type: string

보통 다른 타입 연산자와 함께 typeof를 사용하여 많은 패턴을 편리하게 표현할 수 있습니다.
function f() {
  return { x: 10, y: 3 };
}
type P = ReturnType // Error: f는 값을 가르키지만 유형으로 쓰이고 있다
type P = ReturnType; // type: { x: number; y: number; }

제한
TypeScript는 typeof를 사용할 수 있는 표현식의 종류를 제한합니다.
변수 이름 혹은 프로퍼티에만 typeof를 사용할 수 있습니다.

typescript/type-manipulation/conditional.body:
Conditional Types - 타입 시스템에서 if문처럼 작동하는 타입
Conditional Types를 사용하면 타입관계 검사로 표현된 조건에 따라 두 가지 타입 중 하나를 선택하여 정의할 수 있습니다. JavaScript의 삼항 연산자 조건문(condition ? trueExoression : falseExpression)의 형태와 비슷한 형태를 가졌습니다.
type ConditionalType = SomeType extends OtherType ? TrueType : FalseType

위 내용을 글로 풀어서 쓰면 아래와 같습니다.

SomeType 타입이 OtherType 타입에 할당 가능한 타입이면 TrueType이고, 그렇지 않으면 FalseType

interface Animal {
  live(): void;
}
interface Dog extends Animal {
  woof(): void;
}

type Example1 = Dog extends Animal ? number : string; 
// type: Dog 타입(void)이 Animal 타입(void)에 할당 가능한 타입인가? Yes 그러므로 number

type Example2 = RegExp extends Animal ? number : string;
// type: RegExp 타입(string)이 Animal 타입(void)에 할당 가능한 타입인가? No 그러므로 number

Conditional Types는 Generic과 함께 사용될 때 조금 더 강력하다.
interface IdLabel {
  id: number /* some fields */;
}
interface NameLabel {
  name: string /* other fields */;
}

function createLabel(id: number): IdLabel;
function createLabel(name: string): NameLabel;
function createLabel(nameOrId: string | number): IdLabel | NameLabel;
function createLabel(nameOrId: string | number): IdLabel | NameLabel {
  throw "unimplemented";
}

createLabel 함수의 오버로드 예시이다. 하지만 오버로드는 새로운 타입이 늘어날 수록 코드는 복잡해지고 코드의 량도 늘어납니다. Object Types에 언급했듯이 이럴 때는 generic function을 사용하면 조금 더 간결하게 수정할 수 있다. 그럼 Conditional Types과 generic function을  같이 사용해보자!
type NameOrId = T extends number
  ? IdLabel
  : NameLabel;

function createLabel(idOrName: T): NameOrId {
  throw "unimplemented";
}

let a = createLabel("typescript"); // type: NameLabal

let b = createLabel(2.8); // type: IdLabal

let c = createLabel(Math.random() ? "hello" : 42); // type: NameLabel | Idlabel

조건부 타입으로 제안하기
Conditional Type 의 장점 중 하나는 일반 유형의 가능한 실제 유형을 좁힐 수 있다는 점입니다.
/*
  Flattn에 아무 타입의 배열이 주어지면, number를 사용한 인덱스 접근을 통해 String[] 요소 타입을 가져올 수 있습니다.
  만약 배열이 아닐 시에는 주어진 타입을 반환합니다.
*/
type Flatten = T extends any[] ? T[number] : T;

type Str = Flatten;
/*
  type: string[] 타입이 any[] 타입에 할당 가능한 타입인가? Yes
  그러므로 string[] 타입 배열에 인덱스 접근을 할 시 type은 string
*/
type Num = Flatten;
/*
  type: number 타입이 any[] 타입에 할당 가능한 타입인가? No
  그러므로 type은 주어진 타입 그대로인 number
*/

조건부 타입 내에서 추론하기
조건부 타입은 infer 키워드를 사용해서 참을 비교하는 타입을 추론할 수 있습니다.
infer 키워드
조건부 타입의 조건식이 참으로 평가될 때만 infer 키워드를 사용할 수 있다.

제약 조건 내에서 참조 또는 반환할 변수를 정의 가능

T extends infer U ? X : Y

위 예제를 설명하면 U가 추론 가능한 타입이면 타입이면 X, 아니라면 Y이다.

infer 키워드는 제약조건이 있는데, extends가 아닌 조건부 타입 extends 절에서만 사용 가능하다.

조금 더 이해를 높이기 위해 간단한 예제로 알아보자.
type GetReturnType = T extends (...args: never[]) => infer U ? U : never;

type Num = GetReturnType number>; // type: number

type Str = GetReturnType string>; // type: string

type Bools = GetReturnType boolean[]>; // type: boolean[]

infer 키워드를 조건부 타입에서 사용하면 타입 매개변수가 함수인지 여부를 확인 후 검사 과정에서 반환 타입을 변수로 만들어 R을 유추한 뒤 검사에 성공하면 반환하는 방식으로 수행됩니다.
분배법칙 조건부 타입
Generic Type 위에서 Conditional Type은 Union Type을 만나면 분배법칙이  동작합니다.
type IsNever = [T] extends [never] ? true : false;

위 내용의 IsNever는 실제 never 타입인지 아닌지를 판단하는 타입입니다.
그럼 다음 예제를 보자.
type A = IsNever // type: true
type B = IsNever // type: false

타입 A에 IsNever를 넣으면 타입이 never이니, 당연히 타입은 true가 나올 것이다. 마찬가지로 타입 B에 IsNever를 넣으면 never 타입이 아니니 타입은 false 일 것이다.
그렇다면 위 IsNever를 아래 형식을 바꿔보자!
type IsNever = T extends never ? true : false;

그리고 난 후 똑같은 타입 A, B를 줬는데 결과가 다르다.
type A = IsNever // type: never
type B = IsNever // type: false

타입 A에 IsNever를 넣었더니 타입은 never가 되었고, 타입 B에 IsNever를 넣었더니 타입은 false가 나왔다.

여기서 질문! 왜 그럼 우리가 생각한 대로 나오지 않았을까?

일단 타입 A의 never는 공집합임과 동시에 유니온인데, 타입 매개변수와 유니온이 만나면 분배법칙이 실행된다.
어 그런데 왜? never가 유니온이야? 우리가 알던 방식이 아닌데? 라고 할 수 있겠지만, never는 그 자체로 유니온입니다.
다시 돌아와서,
type IsNever = T extends never ? true : false;
type A = IsNever

위 예제는 앞서 말했듯이 분배법칙이 타입 매개변수와 유니온이 만났으므로 분배법칙이 실행되며, 여기서 알아야 할건 never extends never는 never이다. never는 공집합이기 때문에 제네릭에 들어는 가지만 분배법칙이 일어나지 않는다. 그러므로 type A는 타입이 never 되는 것이다.

우리는 우리가 의도하지 않은 분배법칙을 아래와 같이 제한할 수 있다.

type IsNever = [T] extends [never] ? true : false;  // 방법 1
type IsNever = { type: T } extends { type: never } ? true : false;  // 방법 2

다른 예제들도 알아보자!
type ToArray = Type extends any ? Type[] : never;
type StrArrOrNumArr = ToArray; // type: string[] | number[]



type Diff = T extends U ? never : T;  // U에 할당할 수 있는 타입을 T에서 제거
type Filter = T extends U ? T : never;  // U에 할당할 수 없는 타입을 T에서 제거

type DiffAlphabet = Diff;  // Type: 'b' | 'd'
type FilterAlphabet = Filter; // Type: 'a' | 'c'

typescript/type-manipulation/mapped-type.body:
Mapped Types - 기존 유형의 각 속성을 매핑하여 유형 만들기
들어가기 전, 매핑된 유형(Mapped Types)이 어떤건지 알아보자.
매핑된 유형은 기존 유형에서 유형 정보를 매핑하여 새로운 유형을 만드는 프로세스입니다. 즉 다시 말해 기존에 정의되어 있는 타입을 새로운 타입으로 변환해 주는 문법입니다.
JavaScript로 map에 대해 Array.prototype.map()로 설명하면 아래와 같습니다.
const arr = [{ id: 1, title: 'tomato'}, { id: 2, title: 'apple'}, { id: 3, title: 'orange'}];
const result = arr.map(function(item) {
  return item.title;
});
console.log(result); // ['tomato', 'apple', 'result'];

위 예제를 보면 상수 arr를 선언 후 Array.prototype.map() 함수를 돌려 return 값을 상수 result에 넣어서 console.log()에 찍는 코드이다. 위 과정은 배열에 각 요소를 순회하여 객체(id, title)에서 문자열(title)로 변환하였습니다. 이 과정들이 매핑을 하는 과정과 동일하다.
Mapping Modifiers
매핑 중 추가로 할 수 있는 수정자로는 readonly와 ?(optional)가 있습니다.

- 또는 + : 둘을 접두사라고 부르며, 가변성에 영향을 미친다. 접두사를 사용하여 수정자를 추가하거나 제거할 수 있습니다.
?(optional) : 선택성에 영향을 미친다.


접두사(-, +)를 추가하지 않으면 +로 간주합니다.

- 사용 시 해당 수정자를 제거해야한다.
예제로 예를 들어보자
type CreateMutable = {
  -readonly [Property in keyof Type]: Type[Property];
  // readonly에 접두사인 '-'가 붙었으므로, 유형 속성에서 'readonly'를 제거한다.
};

type Concrete = {
  [Property in keyof Type]-?: Type[Property];
  // '?(optional)'에 접두사인 '-'가 붙었으므로, 유형 속성에서 'optional' 속성을 제거한다.
};

매핑된 유형 수정자(Mapping Modifiers)는 매핑된 유형에 유연성을 추가하여 속성을 필수 및 쓰기 기능으로 만들어 줍니다.
as를 통한 키 재매핑
TypeScript 4.1 이상에서 매핑된 타입에 as절을 사용해서 매핑된 키의 이름을 바꿀 수 있습니다.

Capitalize - 유틸리티 type으로 key를 camelCase로 바꿔준다.
Exclude - 유틸리티 type으로 key에서 제외 시킨다.

간단하게 User에 대한 예제로 한번 자세히 이해해보자.
type User = {
    name: string;
    email: string;
    password: string;
};

type Permissions = 'read' | 'write';

type UserPermissions = {
    [Property in keyof User as `${Permissions}${Capitalize}`]: boolean;
};

전체적으로 정리해보면

User의 각 속성에 대해 키를 가져온다.(name, age, email, password)
키를 카멜 케이스로 유지시킨다.(Capitalize)
템플릿 리터럴로 키 이름을 수정해 준다.(name -> readName);
Permissions가Union type이니 각각 read와 write로 매핑하며 추가한다.

그럼 아래와 같은 결과가 나온다.
type UserPermissions = {
    readName: boolean;
    writeName: boolean;
    readEmail: boolean;
    writeEmail: boolean;
    readPassword: boolean;
    writePassword: boolean;
};

Further Exploration(추가 탐색)
조건부 타입을 사용한 매핑된 타입에 대해서 알아보자. 아래 예제에서는 pii 프로퍼티에 따라 true 또는 false를 반환하는 예제이다.
type ExtractPII = {
  [Property in keyof Type]: Type[Property] extends { pii: true } ? true : false;
};

type DBFields = {
  id: { format: "incrementing" };
  name: { type: string; pii: true };
};

type ObjectsNeedingGDPRDeletion = ExtractPII;

/*
  type ObjectsNeedingGDPRDeletion = {
    id: false;
    name: true;
  }
*/

typescript/type-manipulation/template-li.body:
Template Literal Types - 템플릿 리터럴 문자열을 통해 속성을 변경하는 매핑된 타입
탬플릿 리터럴 유형(Template Literal Types)은 리터럴 유형(Literal Types)을 기반으로 하여 유니온(Union)을 통해 여러 문자열로 확장할 수 있습니다.

JavaScript 템플릿 리터럴 문자열과 구문은 동일하지만 Type 위치에서 사용됩니다.

type Fruit = 'apple' | 'orange';
type Status = 'fresh' | 'rotted';

type AllFruitStatus = `${Fruit}-${Status}`;
// type: AllLocaleIDs = 'apple-fresh' | 'apple-rotted' | 'orange-fresh' | 'orange-rotted'

만약 AllLocaleIDs를 camel case로 쓰고 싶다면,
유틸리티 type인 Capitalize를 사용하면 된다.
type AllFruitStatus = `${Fruit}${Capitalize}`;
// type: AllLocaleIDs = 'appleFresh' | 'appleRotted' | 'orangeFresh' | 'orangeRotted'

Template Literal Types 활용하기
반복되는 타입 정의 없애기
[toss]Template Literal Types로 타입 안전하게 코딩하기
여기서부터는 토스 기술 블로그에서 가져온 내용들입니다
element.addEventListener('click', () => alert('clicked!'));
element.onClick = () => alert('clicked!');

이벤트에 대한 핸드러를 등록할 때, addEventListener('event', handler)와 onEvent=handler의 두 가지 형식을 모두 사용할 수 있는 MyElement 타입을 생각해 봅시다. 아래 두 가지 방법을 모두 사용할 수 있다.
아래의 문제 점이 있다고 생각해보자!
// 이벤트 이름이 하나 추가될 때마다...
type EventNames = 'click' | 'doubleClick' | 'mouseDown' | 'mouseUp';

type MyElement = {
  addEventListener(eventName: EventNames, handler: (e: Event) => void): void;

  // onEvent() 도 하나씩 추가해 줘야한다.
  onClick(e: Event): void;
  onDoubleClick(e: Event): void;
  onMouseDown(e: Event): void;
  onMouseUp(e: Event): void;
}


이벤트 이름(EventNames)이 하나가 추가될 때마다 onEvent()도 하나씩 추가해 줘야하는 불편함이 있다.

이러한 경우에 탬플릿 리터럴 유형(Template Literal Types)을 사용하면 한 곳만 수정해도 모두 반영되게 수정할 수 있습니다.
type EventNames = "Click" | "doubleClick" | "mouseDown" | "mouseUp";
type CapitalizedEventNames = Capitalize;
type HandlerNames = `on${CapitalizedEventNames}`;

type Handlers = {
  [H in HandlerNames]: (event: Event) => void;
};

type MyElement = Handlers & {
  addEventListener: (eventName: EventNames, handler: (event: Event) => void) => void;
};

내장 문자열 조작 유형
문자열 조작을 돕기 위해 문자열 조작에 사용할 수 있는 type 집합들이 있습니다.
Uppercase - 대문자 변환
type Greeting = 'Hello, world'
type ShoutyGreeting = Uppercase // type: 'HELLO, WORLD'

Lowercase - 소문자 변환
type Greeting = 'Hello, world'
type ShoutyGreeting = Lowercase // type: 'hello, world'

Capitalize - 첫 번째 문자 대문자로 변환
type Greeting = 'Hello, world'
type ShoutyGreeting = Capitalize // type: 'Hello, world'

Uncapitalize - 첫 번째 문자 소문자로 변환
type Greeting = 'Hello, world'
type ShoutyGreeting = Uncapitalize // type: 'hello, world'
